	('es','text_datatrans_notice','<b>Note</b>: In order to track your DataTrans orders with the shopping cart software you have to take the following steps:<br /> <br /> -&nbsp;Log in to your DataTrans account<br /> -&nbsp;Click on the <u>\'Upp Data\'</u> link in the <u>\'Upp Administration\'</u> section.<br /> -&nbsp;Set <u>\'URL Post data format\'</u> to <b>\'Data in HTML FORM\'</b>.<br /> -&nbsp;Set <u>\'URL Post\'</u> to:<br /> <b>[post_url]</b><br /> -&nbsp;Click on the <u>\'Security\'</u> link in the <u>\'Upp Administration\'</u> section.<br /> -&nbsp;Select the <b>\'An additional merchant identification will be send with payment messages\'</b> option.<br /> -&nbsp;Generate new digital signature using the <u>\'Generate new sign\'</u> button.<br /> -&nbsp;Set generated value to the <u>\'Digital signature\'</u> field on the DataTrans payment configuration page in your store<br />'),
