	(3,'Check','Check payment','<h2>When I should use check payment</h2><p>Paying with a check is a useful option in case other payment options are unavailable or considered insecure. Note that a check payment is complete only when the check is cashed and clears the bank.</p><p>To pay with a check, enter your signature, account number, and the bank routing number, which is simply a number identifying your bank.</p>','','en'),
