INSERT INTO `cscart_product_descriptions` (`product_id`, `lang_code`, `product`, `shortname`, `short_description`, `full_description`, `meta_keywords`, `meta_description`, `search_words`, `page_title`, `age_warning_message`, `promo_text`)
VALUES
	(1,'en','65\" Class (64.5\" Diag.) LED 8000 Series Smart TV','','','<p>\r\n	     For the ultimate TV enthusiasts, incredible picture quality and advanced connectivity are just the first step; the Samsung UN65D8000 LED TV goes a step beyond, adding elegant design to the formula. On the commanding 65-inch screen you can enjoy Samsung\' Smart TV, which puts the web, a wide range of apps, Skype video calling, and plenty more at your fingertips. Or connect a Blu-ray 3D player to get immersed in cinema-quality 3D programming--two pairs of active glasses are included.\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(4,'en','40\" Class (40.0\" Diag.) LED 5003 Series TV','','','<p>\r\n	Clear Motion Rate (CMR) is Samsung\'s more comprehensive and accurate measure for how well an LCD or LED TV can display fast-moving images. Previously, motion clarity was expressed simply by the refresh rate, measured in Hz. CMR, however, takes into account all three factors that contribute to motion clarity: panel refresh rate, image processor speed and backlight technology.\r\n</p>','','','','','','<p class=\"product-promo-text\">\r\n	<span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span>\r\n</p>'),
	(5,'en','46\" Class (45.9\" Diag.) LCD 610 Series TV','','','<p>\r\n	      ConnectShare™ Movie lets you watch videos, play music or view photos from a USB drive. Simply plug your USB directly into your Samsung TV’s USB port and watch on the big screen with friends and family.\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(6,'en','Toshiba 32C120U 32\" Class 720P HD LCD TV','','','<p>Think you need to break your budget to enjoy blockbuster HD entertainment? Not with Toshiba\'s 32\" class C110U LCD HDTV. Featuring all-new design, this value-packed television looks great and works well in a living room, kitchen or bedroom. Increase detail and depth of the images on your screen with our impressive Dynalight technology.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(7,'en','Trefoil Hoodie','','','<p>The adidas Originals Trefoil Hoodie has been a streetwear essential for  decades, with its characteristic big hood, kangaroo pocket and large  Trefoil. Now it\'s your turn to join the Trefoil men\'s hoodie crew and  carry the legend forward.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(8,'en','Toshiba 32TL515U 32\" Class 1080P 3D LED HD TV','','','<p>\r\n	 Although its attractive features, design, and passive 3D have merit, the picture quality issues of the Toshiba TL515U LED-based LCD TV lessen its appeal in the face of the stiff competition.\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(9,'en','Toshiba 42TL515U 42\" Class 1080P 3D LED HD TV','','','<p>Although its attractive features, design, and passive 3D have merit, the picture quality issues of the Toshiba TL515U LED-based LCD TV lessen its appeal in the face of the stiff competition.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(10,'en','Toshiba 47TL515U 47\" Class 1080P 3D LED HD TV','','','<p>Although its attractive features, design, and passive 3D have merit, the picture quality issues of the Toshiba TL515U LED-based LCD TV lessen its appeal in the face of the stiff competition.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(11,'en','Collegiate 72 Tee','','','<p>It\'s not how old you are, it\'s how stylish, and this men\'s adidas  Originals Collegiate 72 Tee shirt feels just as fresh as it was the day  the Trefoil was born in 1972. That\'s why this t-shirt features a  collegiate \"72\" on the front.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(12,'en','100g Pants','','','<p>\r\n	When coach calls you off the bench, you need warm-up pants that come off  in three seconds or less. That’s why these men\'s adidas 100g basketball  pants have tear-away snaps down the sides, so you\'re ready for action  as fast as a superhero.\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(13,'en','Your Idea, Inc. 12 Steps to Building a Million Dollar Business -- Starting Today!','','','<p style=\"text-align: left; color: #000000; font-size: 12px; background-color: #ffffff;\">\r\n	Every time a new story about how some nobody from nowhere got rich producing some clever new product in his garage, you may think, \"Why can\'t I do that?\" Well, anyone can--the trick is to take those good ideas and build them into great products that can succeed in the marketplace. In this book, you will get the 12-step plan you need to make your new product or service a profitable reality. You will learn important skills for success, including how to:\r\n</p>\r\n<ul style=\"text-align: left; color: #000000; font-size: 12px; background-color: #ffffff;\">\r\n	<li style=\"text-align: left;\">Refine their idea to attract a target audience</li>\r\n	<li style=\"text-align: left;\">Research the competition</li>\r\n	<li style=\"text-align: left;\">Find the right manufacturer</li>\r\n	<li style=\"text-align: left;\">Create appropriate brand messaging</li>\r\n	<li style=\"text-align: left;\">Build buzz online and beyond</li>\r\n	<li style=\"text-align: left;\">Work trade shows and conventions</li>\r\n</ul>\r\n<p>\r\n	<span style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">Written by a woman with no formal business experience who turned her own idea into a million-dollar company, this book is the pragmatic yet inspiring guide every aspiring entrepreneur is looking for.</span>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(14,'en','Toshiba 40E220U 40\" Class 1080P HD LCD TV','','','<p>Enjoy a stunning picture bursting with color and clarity with the 40-inch Toshiba 40E200U LCD HDTV (40-inch diagonal screen size), featuring a 1080p Full HD resolution that provides twice the pixel resolution of 720p HD models. It provides a number of convenient home entertainment options and key picture quality features, including DynaLight dynamic backlight control for deeper black levels and four HDMI digital inputs for simple high quality connection to cable/satellite boxes, DVD players and more. Plus, the HDMI ports feature fast InstaPort switching for quick changes from one source to another.&nbsp;<br /><br />DynaLight automatically adjusts the backlight intensity based on the image content.<br /><br /> With the Gaming Mode function, you\'ll experience reduced game control delay and improved reaction time--perfect for PC gaming--and the Photo Frame capability with Auto Slide Show enables you to display slideshows of your favorite images when not watching TV programming. <br /><br /> Boasting a slimming tapered bezel and attractive front panel gradation, the new Horizon design creates a more modern, elegant appearance that also adds a subtle luminance to the logo to further its stylish appeal. Other features include MP3 playback via the integrated USB port, a PC input, and a removable stand.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(15,'en','Nike Chambray Super Runner Men\'s Jacket','','<p>The  timeless Windrunner design gets a premium upgrade in the Nike Chambray  Super Runner Men\'s Jacket. Created with tough, water-resistant fabric  and a mesh lining, this jacket combines breathability and protection  from the elements.</p>','<div class=\"text description black-white\">\r\n<div class=\"product-description-component\">\r\n<p><strong>The Nike Chambray Super Runner Jacket: A durable, updated classic </strong></p>\r\n<br />\r\n<p>The  timeless Windrunner design gets a premium upgrade in the Nike Chambray  Super Runner Men\'s Jacket. Created with tough, water-resistant fabric  and a mesh lining, this jacket combines breathability and protection  from the elements.</p>\r\n<br />\r\n<p><strong>Benefits</strong></p>\r\n<li>Hood with drawcord for an adjustable fit</li>\r\n<li>Overlay at yoke and raglan sleeves for style and enhanced protection</li>\r\n<li>Rib cuffs and hem for a fit that stays in place</li>\r\n<li>Mesh lining for enhanced ventilation</li>\r\n<li>Durable, wind-resistant fabric to protect against the elements</li>\r\n<br />\r\n<p><strong>Additional Details</strong></p>\r\n<li>Side zip pockets for secure storage</li>\r\n<li>Fabric: Body: 100% cotton. Lining and overlay: 100% polyester.</li>\r\n<li>Machine wash</li>\r\n<li>Imported</li>\r\n</div>\r\n</div>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(16,'en','3D Blu-ray Disc™ Player (BD-D7500)','','','<p>Whether you are viewing a premium-quality 2D picture or seeing incredible 3D depth, images are breathtakingly real in Samsung Full HD. Combine with a 3D TV and 3D active shutter glasses to view the latest Hollywood 3D titles or amplify your viewing experience by upconverting 2D content to immersive 3D.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(17,'en','101 Things Everyone Should Know About Economics A Down and Dirty Guide to Everything from Securities and Derivatives to Interest Rates and Hedge Funds—And What They Mean For You','','','<p><span style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">What you don\'t know about economics can hurt you&mdash;now more than ever. This easy-to-understand guide answers all the questions you need to know to secure your financial future, such as:</span></p>\r\n<ul style=\"text-align: left; color: #000000; font-size: 12px; background-color: #ffffff;\">\r\n<li style=\"text-align: left;\">What does it mean to my paycheck when the Fed lowers or raises interest rates?</li>\r\n<li style=\"text-align: left;\">What\'s the difference between bonds, securities, and derivatives&mdash;and which should I invest in now?</li>\r\n<li style=\"text-align: left;\">What does Keynesian economics have to do with my savings?</li>\r\n</ul>\r\n<p><span style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">For those people whose heads spin when reading the business pages of the newspaper, here\'s a roadmap through the economic jungle. In simple, plain language, Peter Sander explains how economies work, why they grow, how they contract, and what the government can and can\'t do to help them. Most important, he tells you how all this affects&nbsp;</span><em style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">you</em><span style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">&mdash;and what kind of changes you\'re going to see in your finances as a result.</span></p>\r\n<p style=\"text-align: left; color: #000000; font-size: 12px; background-color: #ffffff;\">Economics has been called the \"dismal\" science. But it doesn\'t need to be gloomy or impenetrable. This book is an essential guide for anyone who wants to understand where the economy is today, where it\'s going, and what it means for the rest of us.</p>\r\n<p>&nbsp;</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
