	(45,'en','The Process of Research in Psychology','','','<p><strong style=\"color: #000000; font-family: Arial, Verdana, \'Sans Serif\'; line-height: 15px; text-align: justify;\">A student friendly, thoughtfully organized introduction to research in psychology&nbsp;</strong><br style=\"color: #000000; font-family: Arial, Verdana, \'Sans Serif\'; line-height: 15px; text-align: justify;\" /><br style=\"color: #000000; font-family: Arial, Verdana, \'Sans Serif\'; line-height: 15px; text-align: justify;\" /><span style=\"color: #000000; font-family: Arial, Verdana, \'Sans Serif\'; line-height: 15px; text-align: justify;\">Employing numerous examples and the pedagogical approach of spaced repetition, this introductory text provides a step-by-step explanation of how to design, conduct, and present a research study in psychology. Chronologically organized and chock-full of pedagogy, this book creates logical scaffolding upon which students can build their knowledge.</span><br style=\"color: #000000; font-family: Arial, Verdana, \'Sans Serif\'; line-height: 15px; text-align: justify;\" /></p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
