	(54,'en','TS-W3002D2|D4','','','<p>The TS-W3002D2/4 subwoofers are designed to produce enormously powerful music. Just take a look at its super-heavy-duty construction, all designed to handle up to 3,500 watts max. Double-stacked magnets for higher power, and a step-up radial surround for superior control and long excursions. We used a constructed cast-aluminum basket for this sub. Add in our patented IMPP cone and you\'ve got a monster sub that can handle whatever you want to throw at it.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(55,'en','PRS-D800','','','<p>The PRS-D800 2-channel amplifier contains audiophile grade components that were carefully selected and design perfected to achieve highest audio quality.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(56,'en','GM-6500F','','','<p>From dramatic distinction to dramatic design, Pioneer\'s new GM-Series amplifiers are thrillers in every sense, pushing the limits of flexibility and functionality.<br /><br />The 4-channel GM-6500F delivers a whopping 760 watts max - plenty of juice to power your speakers. It\'s also got built-in low-pass/high-pass crossovers, speaker level inputs for easy connection to an OEM headunit and oversized power terminals.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(57,'en','GM-D8500M','','','<p>Class-D amplifiers overcome the inefficiencies of traditional Class-A or AB amplifiers. Pioneer&rsquo;s Class-D amps transform very little power into heat so a higher percentage of the power supply (67%) is transformed into the load. This results in a very compact amp which needs less input power to produce very high output power. The Class-D amplifier&rsquo;s PWM (Pulse Width Modulator) modulates the original audio input signal with a triangulated signal wave which has a much higher fixed frequency. The result is a digital signal which contains both the input signal and a band of frequency components around the modulation frequency. A LPF (Low Pass Filter) then filters out the high frequency pulses and the resulting amplified output signal is then sent to the subwoofer and/or speakers.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
