	(67,'en','HTC Wildfire S - White (T-Mobile)','','','<p>The HTC Wildfire S for T-Mobile is a 3G capable smartphone that adds style to a practical device. This sleek device runs on the Android&trade; 2.3 platform, so you can have the latest Android&trade; technology and access to thousands of apps. It also features a 3.2 inch capacitive touchscreen, a 5 megapixel camera for capturing important moments and Wi-Fi calling/hotspot capabilities! Weighing only 3.7 ounces, the Wildfire S is extremely portable. If you are looking for a stylish and fun smartphone that is easy to use, the HTC Wildfire S could be the phone for you!</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(68,'en','Titan','','','<p>In the right hands, amazing things happen.<br /><br />Put emails in their place<br /> Combine your personal inboxes while keeping your work account separate.<br /><br />Plenty of room in the office<br /> Microsoft&reg; Office Mobile and multitasking on a huge <br /> 4.7\" screen makes plenty of room for work, wherever you go.<br /><br />Focus on thoughts, not thumbs<br /> With such a spacious keypad, you can stop focusing on your fingers and start focusing on ideas.<br /><br />Expansive display, infinite possibility<br /> Whether you&rsquo;re taking care of business or taking a break from it all, you can see the big picture on the 4.7\" LCD screen.<br /><br />Pocket-sized profile<br /> At 9.9mm, it&rsquo;s slim enough to fit comfortably in your pocket. But considering everything the HTC TITAN with Windows Phone is capable of, it won&rsquo;t be spending much time there.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(69,'en','Rhyme','','','<p>HTC Rhyme&trade; and its suite of innovative accessories<br /> deliver seamless experiences.<br /><br />Docking Station<br />Effortlessly slide the HTC Rhyme into the Docking Station to charge it and automatically activate Dock Mode, turning your phone into an all-in-one alarm clock, music player, and picture frame.<br /><br /> Charm<br /> Attached to your bag, the Charm alerts you of calls, missed calls, and messages. It also keeps your phone within easy reach and goes with anything.<br /><br /> Tangle&ndash;free Headphones<br /> These headphones don&rsquo;t just sound amazing&mdash;they&rsquo;re virtually tangle-free, thanks to flat wires.<br /><br />Exclusive HTC Sense&trade; experience<br /> The HTC Rhyme delivers a visually refined and intuitive <br /> HTC Sense experience. Find what you want faster with streamlined menus across HTC Sense apps and get the live info you care about on the home screen with the Quick Launch widget. Stay on top of all your to-dos by creating tasks from emails and messages, then sync those tasks with your Microsoft&reg; Exchange account for one to-do list on phone and PC.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(70,'en','EVO Design 4G','','','<p>The HTC EVO Design 4G is a high-end smartphone that is packed full of the latest features! Powered by Android 2.3, this device comes pre-loaded with the newest Android Platform for smartphones. You can choose from thousands of apps and games at the Android Marketplace. The HTC EVO Design 4G also comes loaded with a 4.0&rdquo; qHD capacitive touch display, with the latest version of HTC Sense, and international phone capabilities. With a 5 megapixel main camera, you will have the ability to capture, record and playback in HD. This smartphone also features a 1.3 megapixel front-facing camera for video chats! Quickly download movies and create user generated content with a flash-enabled web browsing experience running on Sprint\'s 4G network and the power of a 1.2 GHz processor.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(71,'en','DROID INCREDIBLE 2','','','<p>Socialize with a sense of style<br /> The Droid Incredible 2 by HTC is ready to party. Its sleek, all-black design will get looks, and front and back cameras can help capture a scene, start a conversation, or snap a self-portrait. You can record the night\'s most memorable moments in 720p HD video for sharing later.<br /><br />A phone that\'s designed around you<br /> HTC Sense&trade; lets you do more in fewer steps with a friendly experience that brings everything you care about right to the surface. You can easily make your phone your own and put everything exactly where you want it. FriendStream&trade; pulls together all your friends\' Twitter,&trade; Facebook,&reg; and Flickr&reg; updates in one place. Here\'s an idea: Choose a People widget that lets you see everybody\'s latest updates and messages right on the home screen. You can also select a compact People widget that just shows their profile pictures.<br /><br />Worth watching &mdash; and listening to<br /> Your music and movies look and sound great on a 4-inch super LCD screen with SRS WOW&trade; HD surround sound. Get access to unlimited songs through V CAST&trade; Music with Rhapsody or tune in to the expert DJs on Slacker&reg; Internet Radio. V CAST Video on Demand gives you on-the-go access to more shows and movies, including those available from BLOCKBUSTER On Demand.&reg;<br /><br />Invite friends to your own private Hotspot<br /> Your phone turns into a 3G Mobile Hotspot, for up to five other Wi-Fi&reg;&ndash;enabled devices. That just might make you more popular than ever.<br /><br />Call anyone, anywhere &mdash; no matter where you travel<br /> The global-ready Droid Incredible 2 by HTC will keep you connected from Lima to London.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(72,'en','DROID RAZR','','','<p>DESIGN: THINNEST 4G LTE SMARTPHONE<br />DROID RAZR is so thin, it makes microchips feel flabby. The thinnest 4G LTE smartphone, it can get you out of the tightest of situations while letting you keep your cool.<br /><br />CONSTRUCTION: DROID STRONG, RAZR SHARP<br />DROID RAZR proves that thin no longer equals frail. It\'\'s made strong with KEVLAR&reg; fiber, while Corning&reg; Gorilla&reg; Glass defends the screen against scrapes and scratches. A force field of water-repellent nanoparticles shields the phone against water attacks - even the electrical boards inside.<br /><br />NETWORK SPEED: DOMINATE AT WARP SPEED<br />Unleash the fierce power of Verizon\'s 4G LTE network, piloted by a dual-core 1.2 GHz processor. Blast your music and check the score, while email reloads - all at the same time, without delay. The 1 GB of RAM keeps you rocketing through.<br /><br />DUAL CAMERAS: LIFE HAS NEVER LOOKED BETTER<br />Create some cinematic awesomeness of your own with an 8MP rear camera and 1080p HD video recording. Ready for all conditions, DROID RAZR has image stabilization technology for less blurry video.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(73,'en','DROID BIONIC','','','<p>With a ferociously fast Verizon Wireless 4G LTE network and dual-core 1 GHz processor, DROID BIONIC is the master of all Droids. And with ZumoCast&trade; by Motorola, nothing is beyond your digital reach. The free app lets you pull your music, movies, pictures and documents from your computer like a digital telepath - instantly and wirelessly. That\'s right, DROID BIONIC is so powerful, it can control your connected devices and extract their precious content, remotely, at 4G LTE speed. That makes it not only the master of all Droids, but the master of machines.<br /><br />Key Features:<br /> Our free Zumocast&trade; app lets you stream content 24/7 and in real time from your computer <br /> 4G LTE speeds up to 10x faster than 3G to stream movies, watch TV and video chat <br /> Crisp text, vivid imagery and brilliant color delivered in 4.3-inch high res qHD <br /> Doubles as a 4G LTE mobile hotspot for up to 5 Wi-Fi enabled devices <br /> Dual-core 1GHz processor and 1GB RAM <br /> Webtop app transforms your phone; surf the web, run apps and take calls - all at the same time <br />In The Box:<br /> DROID BIONIC phone<br />HW4X Standard Battery<br /> Standard Battery Door<br />Travel Charger<br />Micro USB Data cable<br /> User Guide</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(74,'en','Droid 3','','','<p>You\'re going places, and DROID 3 by Motorola can take you there. With incredible dual-core speed and brilliant qHD display. You\'re making a big Android smartphone statement. DROID 3 offers more power and greater responsiveness, and the efficient handling of a five-row keyboard. The thinnest full QWERTY smartphone. Ever.<br /><br />Key Features: <br />Adobe&reg; Flash&reg; Player for stellar video and gaming<br />Scratch-resistant Corning&reg; Gorilla&reg; Glass with glare reducing coating<br />View, capture and share on the large 4-inch qHD display<br />An 8MP camera with 1080p HD video and front-facing web cam to see and be seen<br />Video capture in 1080p HD; output to compatible device via HDMI&reg; micro connector cable<br />Thinnest Full QWERTY smartphone ever.<br /> Super-charged dual-core 1GHz processor makes multi-tasking a snap<br /> What you get in the box: <br />DROID 3 phone <br />Battery Door <br />Battery <br />Charger <br />User Guide</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(75,'en','DROID PRO','','','<p>Access your work directory, email or calendar with Droid Pro by Motorola, an Android-for-business smartphone with corporate-level-security. It features both a QWERTY keyboard and touchscreen, a speedy 1 GHZ processor and Adobe&reg; Flash&reg; Player 10.<br /><br /> Key Features: <br /> Up to 2GB memory on board, 2GB microSD pre-installed, expandable up to 34GB <br /> 5MP camera with auto focus and dual-LED flash <br /> Touchscreen navigation, pinch to zoom and customized home screens <br /> CDMA plus quad-band GSM and tri-band UTMS <br /> Ultra-fast 1 GHz processor for better web browsing and speedy UI and downloads <br /> Android 2.2 (Froyo) Platform <br /> Mobile Email: IMAP and POP, Microsoft Exchange, Gmail&trade;, MSN Hotmail&reg;, Yahoo!&reg; and AOL&reg; <br /> Quickoffice&reg;, Skype mobile&trade;, YouTube, AuthenTec VPN client, Mediashare, File Manager <br /> Be a mobile hot spot for up to 5 other devices <br /> Adobe&reg; Flash&reg; Player 10 <br />What you get: <br /> DROID PRO by Motorola phone <br /> Battery <br /> Battery Door <br /> Travel Charger <br /> User Guide</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(76,'en','FLIPSIDE with MOTOBLUR','','','<p>MOTOROLA FLIPSIDE&trade; is a powerhouse at work or play, with enhanced MOTOBLUR to not only sync social media, but now to help prioritize - with content filters and resizable widgets to keep you on track.<br /><br /> Key Features: <br />Use Global Address Lookup to access corporate directions and easily schedule meetings on the go <br /> Touchscreen supports pinch-to-zoom or slide open for QWERTY keyboard and laptop-like nav pad <br /> Extend time between charges as MOTOBLUR battery manager monitors power consumption <br />Prioritize home screen messages using MOTOBLUR filters and resizable widgets <br />CrystalTalk&trade; PLUS technology amplifies your voice and filters out background noise <br />Facebook&trade;, MySpace and Twitter Direct Messaging <br />What you get in the box:: <br />FLIPSIDE&trade; with MOTOBLUR&trade; for AT&amp;T phone <br /> Battery BT61 <br /> Battery Door <br />Travel Charger <br /> User Guide</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
