	(112,'en','Gone with The Wind: 2-Disc Special Edition','','','<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Theatrical Release Date: 12/14/1939</p>\r\n<p>Run Time: 238 minutes</p>\r\n<p>Special Features:</p>\r\n<p>Commentary by Historian Rudy Behlmer</p>\r\n<p>&nbsp;</p>\r\n<p>Mail-in poster offer</p>\r\n<p>Media Quantity: Multi D</p>\r\n<p>Packaging Type: Double Eco Amaray Case</p>\r\n<p>Copyright:</p>\r\n<p>GONE WITH THE WIND, its characters and elements are trademarks of Turner Entertainment Co. &amp; The Stephens Mitchell Trusts. &copy; Turner Entertainment Co.</p>\r\n<p>Genre: Classic, Drama, Romance</p>\r\n<p>Synopsis:</p>\r\n<p>Period romance. War epic. Family saga. Popular fiction adapted with crowd-pleasing brilliance. Star acting aglow with charisma and passion. Moviemaking craft at its height. These are sublimely joined in the words Gone with the Wind. This dynamic and durable screen entertainment of the Civil War-era South comes home with the renewed splendor of a New 70th-Anniversary Digital Transfer capturing a higher-resolution image from Restored Picture Elements than ever before possible. David O. Selznick&rsquo;s monumental production of Margaret Mitchell&rsquo;s Pulitzer Prize-winning book can now enthrall new generations of home viewers with a majestic vibrance that befits one of Hollywood&rsquo;s greatest achievements.</p>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
