	(114,'en','Birds of Prey: The Complete Series (DVD)','','','<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Screen Aspect: 4 X 3 FULL FRAME</p>\r\n<p>Episodes Info :</p>\r\n<p>13 One-Hour Episodes</p>\r\n<p>&nbsp;</p>\r\n<p>Pilot</p>\r\n<p>Slick</p>\r\n<p>Prey for the Hunter</p>\r\n<p>Three Birds and a Baby</p>\r\n<p>Sins of the Mother</p>\r\n<p>Primal Scream</p>\r\n<p>Split</p>\r\n<p>Lady Shiva</p>\r\n<p>Nature of the Beast</p>\r\n<p>Gladiatrix</p>\r\n<p>Reunion</p>\r\n<p>Feat of Clay</p>\r\n<p>Devil\'s Eye</p>\r\n<p>Special Features:</p>\r\n<p>GOTHAM GIRLS SEASONS 1-3 - The animated web-based series featuring the</p>\r\n<p>female heroes and rogues from Gotham City.</p>\r\n<p>Media Quantity: Multi D</p>\r\n<p>Packaging Type: VIVA 4 Disc 15mm Case</p>\r\n<p>Genre: Drama, Television</p>\r\n<p>Synopsis:</p>\r\n<p>Who will stand up to villains now that a heartbroken Dark Knight has mysteriously vanished? Never fear, New Gothamites, a trio of champions is ready to take wing &ndash; and Helena, the daughter of Batman and Catwoman, is among them. She calls herself Huntress and crime is her prey. Teenaged Dinah is the youngest of the group, learning as she goes and gifted in clairvoyance. And overseeing the awesome threesome&rsquo;s high-tech nerve center is Batgirl. Left wheelchair-bound by The Joker, she has reinvented herself as Oracle, the team&rsquo;s cyber expert. Huntress, Dinah, Oracle: They are the Birds of Prey. Fighting together. Living together. And soaring into adventure together in 13 breathtaking live-action episodes.</p>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
