	(111,'en','Last Samurai, The (DVD) (WS)','','','<p>\r\n<p>Official Website: http://lastsamurai.warnerbros.com/</p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Theatrical Release Date: 12/04/2003</p>\r\n<p>Screen Aspect: 16 X 9 LETTERBOX</p>\r\n<p>Run Time: 154 minutes</p>\r\n<p>Special Features:</p>\r\n<p>Audio Commentary: Commentary by Edward Zwick</p>\r\n<p>Deleted Scenes: The Beheading (Behind the Beheading)</p>\r\n<p>&nbsp;</p>\r\n<p>Algren and Katsumoto</p>\r\n<p>&nbsp;</p>\r\n<p>Documentaries: History vs. Hollywood: The Last Samurai {History Channel Documentary)</p>\r\n<p>Featurette: Tom Cruise: A Warrior\'s Journey</p>\r\n<p>&nbsp;</p>\r\n<p>Edward Zwick: Director\'s Video Journal {Behind-the-scenes production journal - narrated by Ed Zwick and Tom Cruise</p>\r\n<p>&nbsp;</p>\r\n<p>A World of Detail: Production Design with Lilly Kilvert</p>\r\n<p>&nbsp;</p>\r\n<p>Silk and Armor: Costume Design with Ngila Dickson</p>\r\n<p>&nbsp;</p>\r\n<p>Imperial Army Basic Training: From Soldier to Samurai: The Weapons</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Interviews: Making an Epic: A Conversation with Edward Zwick</p>\r\n<p>Other: Japan Premieres {Tokyo &amp; Kyoto red carpet)</p>\r\n<p>Packaging Type: Eco Amaray Case</p>\r\n<p>Subtitle Languages:</p>\r\n<p>English</p>\r\n<p>French</p>\r\n<p>Spanish</p>\r\n<p>Copyright:</p>\r\n<p>&copy; 2003 Warner Bros. Entertainment Inc. All Rights Reserved.</p>\r\n<p>Genre: Action/Adventure, Drama, Period, War, WESTERN</p>\r\n<p>Synopsis:</p>\r\n<p>Epic Action Drama. Set in Japan during the 1870s, The Last Samurai tells the story of Capt. Nathan Algren (Tom Cruise), a respected American military officer hired by the Emperor of Japan to train the country\'s first army in the art of modern warfare. As the Emperor attempts to eradicate the ancient Imperial Samurai warriors in preparation for more Westernized and trade-friendly government policies, Algren finds himself unexpectedly impressed and influenced by his encounters with the Samurai, which places him at the center of a struggle between two eras and two worlds, with only his own sense of honor to guide him.</p>\r\n<p>\"Two Thumbs Up\" - EBERT &amp; ROEPER&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>\"A stunning beautiful epic adventure\" - ROGER EBERT / EBERT &amp; ROEPER&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>\"It\'s a spectacular epic. Tom Cruise is truly magnificent. - PAUL CLINTON / CNN&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>\"Ken Watanabe is magnetic and majestic.\" - LISA SCHWARZBAUM / ENTERTAINMENT WEEKLY&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>\"The Last Samurai is a movie that demands our surrender\" - RICHARD SCHICKEL / TIME&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>\"Bold and daring. The battle scenes are astonishing!\" - JEFFREY LYONS / NBC&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>\"The Last Samurai\' is a transfixing, majestic experience.\" - GENE SHAL</p>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(110,'en','Roots 30th Anniversary Special Edition (DVD)','','','<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Screen Aspect: 4 X 3 FULL FRAME</p>\r\n<p>Media Quantity: Multi D</p>\r\n<p>Packaging Type: Slipcase - Super Slim</p>\r\n<p>Copyright:</p>\r\n<p>TM &amp; (c) Warner Bros. Entertainment Inc.</p>\r\n<p>Genre: Black Theme or Star</p>\r\n<p>Synopsis:</p>\r\n<p>Based on Alex Haley\'s best-selling novel about his African ancestors, Roots followed several generations in the lives of a slave family. The saga began with Kunta Kinte (LeVar Burton), a West African youth captured by slave raiders and shipped to America in the 1700s. The family\'s saga is depicted up until the Civil War where Kunte Kinte\'s grandson gained emancipation. Roots made its greatest impression on the ratings and widespread popularity it garnered. On average, 130 million - almost half the country at the time - saw all or part of the series.</p>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
