	(116,'en','I Am Legend (DVD) (WS)','','','<p>\r\n<p>fficial Website: <a title=\"http://iamlegend.warnerbros.com/\" href=\"http://iamlegend.warnerbros.com/\">http://iamlegend.warnerbros.com/</a></p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Theatrical Release Date: 12/13/2007</p>\r\n<p>Screen Aspect: 16 X 9 LETTERBOX</p>\r\n<p>Special Features:</p>\r\n<p>4 awesome animated comics: Death as a gift, Isolation, Sacrificing the Few for the Many and Shelter</p>\r\n<p>DVD-ROM PC weblink to intense bonus material databanki chronicling the movie\'s creation and exploring the history and current status</p>\r\n<p>of life-threatening viral infections</p>\r\n<p>Packaging Type: Amaray Case</p>\r\n<p>Copyright:</p>\r\n<p>(c) 2007 A Warner Bros. Entertainment Inc. All Rights Reserved</p>\r\n<p>Genre: Action/Adventure, Drama, Horror, Sci-Fi/Fantasy</p>\r\n<p>Synopsis:</p>\r\n<p>Robert Neville is a brilliant scientist, but even he could not contain the terrible virus that was unstoppable, incurable, and man-made. Somehow immune, Neville is now the last human survivor in what is left of New York City and maybe the world. For three years, Neville has faithfully sent out daily radio messages, desperate to find any other survivors who might be out there. But he is not alone. Mutant victims of the plague -- The Infected -- lurk in the shadows... watching Neville\'s every move... waiting for him to make a fatal mistake. Perhaps mankind\'s last, best hope, Neville is driven by only one remaining mission: to find a way to reverse the effects of the virus using his own immune blood. But he knows he is outnumbered... and quickly running out of time.</p>\r\n<p>\"I Am Legend is mind-blowing excitement...\" Pete Hammond / Maxim</p>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
