	(125,'en','Samsung Galaxy S II','','','<dl><dt>The Galaxy S II has an amazing 4.27\" Super  AMOLED Plus screen. This superb display has razor sharp clarity and  breathtaking color. See every detail of videos and pictures. See the  full range of hues in all their subtlety and brilliance. And with its  superior wide viewing angle, you don\'t have to be directly in front of  the screen to see a perfect image. Truth is, you really have to see it  to believe it.</dt></dl>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(126,'en','Casio PRIZM fx-CG10','','','<p><br /><img style=\"word-wrap: break-word; border-style: initial; border-color: initial;\" src=\"http://www.casio.com/resource/images/pressreleases/fx-CG10_Prizm_press_2.jpg\" alt=\"PRIZM fx-CG10\" align=\"right\" /><strong style=\"word-wrap: break-word;\">High-resolution color LCD with full textbook-style display</strong><br style=\"word-wrap: break-word;\" /><br style=\"word-wrap: break-word;\" />The color LCD offers full textbook-style display with the highest pixel resolution* (82,944 dots) and widest color reproduction* (65,536 colors) of any calculator. PRIZM&trade; comes with high-resolution fonts up to 18x24 dots (including blank dots), to enable equations and text to be displayed just like they appear in textbooks. The Blanview LCD delivers superior visibility and low power consumption, enabling color display with an estimated run time of 140 hours on four AAA-size alkaline batteries.**<strong style=\"word-wrap: break-word;\"><br style=\"word-wrap: break-word;\" /></strong>*As of October 7, 2010, for the pixel resolution and color reproduction of calculators. According to a survey by Casio Computer Co., Ltd.<br style=\"word-wrap: break-word;\" />**Using repetition of the following one-hour sequence: Menu display for 5 minutes, Run-Matrix mode calculation for 5 minutes, flashing cursor in Run-Matrix mode for 50 minutes. Based on default settings for display brightness and auto power off. (Refer to the Specifications for exact settings)&nbsp;&nbsp;<strong style=\"word-wrap: break-word;\"><img style=\"word-wrap: break-word; border-style: initial; border-color: initial;\" src=\"http://www.casio.com/resource/images/pressreleases/fx-CG10_Prizm_press_3.jpg\" alt=\"PRIZM fx-CG10\" align=\"right\" /></strong><strong style=\"word-wrap: break-word;\">Picture Plot enables learning from real-life pictures</strong><strong style=\"word-wrap: break-word;\">&nbsp;</strong><br style=\"word-wrap: break-word;\" /><br style=\"word-wrap: break-word;\" />Picture Plot enables users to create their own graphs over pictures displayed on the color LCD. PRIZM&trade; comes with 55 types of color pictures that users can create graphs over, such as a picture of the parabola of jets from a water fountain and an image sequence of a clock&rsquo;s pendulum movement. Users can perform regression calculations from the completed graphs to enhance their understanding of math functions.&nbsp;&nbsp;&nbsp;<strong style=\"word-wrap: break-word;\">Multitude of functions that leverage the color LCD</strong><br style=\"word-wrap: break-word;\" /><br style=\"word-wrap: break-word;\" />Colors can be added to a multitude of graphing objects including dotted lines, circles, and bars, as well as grid lines on graphs, labels of coordinate axes, and coordinate values displayed during tracing. The Color Link function links the colors used in graphs to the designated values in the spreadsheet screen, to aid the visual comprehension of trends and changes in values. PRIZM&trade; automatically color-codes brackets when entering equations with multiple brackets, as a visual aid to facilitate the entry of complex equations.&nbsp;</p>\r\n<table style=\"word-wrap: break-word;\" align=\"center\">\r\n<tbody style=\"word-wrap: break-word;\">\r\n<tr style=\"word-wrap: break-word;\">\r\n<td style=\"word-wrap: break-word;\"><strong style=\"word-wrap: break-word;\"><img style=\"word-wrap: break-word; border-style: initial; border-color: initial;\" src=\"http://www.casio.com/resource/images/pressreleases/fx-CG10_Prizm_press_3.jpg\" alt=\"PRIZM fx-CG10\" align=\"left\" /></strong></td>\r\n<td style=\"word-wrap: break-word;\"><strong style=\"word-wrap: break-word;\"><img style=\"word-wrap: break-word; border-style: initial; border-color: initial;\" src=\"http://www.casio.com/resource/images/pressreleases/fx-CG10_Prizm_press_4.jpg\" alt=\"PRIZM fx-CG10\" align=\"left\" /></strong></td>\r\n<td style=\"word-wrap: break-word;\"><strong style=\"word-wrap: break-word;\"><img style=\"word-wrap: break-word; border-style: initial; border-color: initial;\" src=\"http://www.casio.com/resource/images/pressreleases/fx-CG10_Prizm_press_5.jpg\" alt=\"PRIZM fx-CG10\" align=\"left\" /></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(127,'en','Fore CR5 SRAM Red','','','<p>An all new frame and new graphics package make the Fore CR5 look as  fast as it really is. Now available with SRAM Red componants.</p>\r\n<p>What do you get when you interview hundreds of riders, questioning them  about their desires for the ultimate road bike and then, spend  thousands of hours translating those ideas into reality? A dream come  true. We call it the Fezzari For&eacute; CR5. It is the pinnacle of road bike  performance. From its all new state of the art, proprietary Fezzari  Racing Design Xr7 3K monocoque carbon frame to its best-of-market  components, the For&eacute; CR5 is THE ultimate road bike. Our designers and  engineers didn\'t cut corners.<br /> <br /> Take, for instance, the state of the art proprietary Fezzari Racing  Design Xr7 3K monocoque carbon fiber frame. We used the highest grade of  carbon fiber available on the market. We made it even stiffer laterally  by enlarging the bottom bracket shell and adding the BB30 bottom  bracket/crank design, strengthening the headtube and making it more  laterally stiff by enlarging the diameter to a 1.5\" tapered design.  We\'ve also enlarged the seatstays near the rear axle for more lateral  rigidity. We made the Xr7 frame even more vertically compliant for those  rides on the cobblestones. We\'ve done this by using an oval design in  our top tube and down tube.&nbsp; The new Xr7 frame is even more aerodynamic  than before with the new F4 ultralight bladed carbon fork and internal  cable routing on the top tube.&nbsp; The Xr7 frame was recently tested to be  one of the most durable frames on the market, and it weighs a mere 900  grams. Strength, lightweight, rigidity where you need it most, and  flexible enough to take the edge off of rough roads -- it\'s the perfect  frame for anyone who wants to get the most out of their riding  experience.<br /> <br /> Next, take a look at the perfect blend of components. The Fore CR5  includes SRAM Red components shifters, brakes and derraileurs, FSA  K-Force Light BB30 Carbon Crankset, Fezzari F4 XrT 3K carbon ultralite  bladed carbon fork with carbon steerer tube, FSA K-Force compact carbon  bars, FSA K- Force carbon seat post, and even carbon spacers on the  headset.<br /> <br /> Finally, add the new sleek graphics and logos and you have--the ultimate road ride.<br /> <br /> You get the following upgrades over the CR3:</p>\r\n<ol>\r\n<li> <strong>Upgraded Frameset</strong> &ndash; from the Xr5 to the new Xr7  frame,&nbsp; more lateral stiffness with a BB30 crank system, enlarged  headtube for better cornering, and sprinting, added rigidity in the rear  triangle, increased aerodynamics with the new F4 bladed fork design and  internal cable routing.</li>\r\n<li> <strong>Upgraded Shifters</strong> &ndash; from Shimano Ultegra to the flagship SRAM Red, for smoother, more precise shifting</li>\r\n<li> <strong>Upgraded Front Derailleur</strong> &ndash; from Shimano Ultegra to SRAM Red, which is lighter and smoother</li>\r\n<li> <strong>Upgraded Cassette</strong> &ndash; from Shimano Ultegra to SRAM Red</li>\r\n<li> <strong>Upgraded Crankset</strong> &ndash; from FSA SLK Light to FSA K-Force Light, which is lighter</li>\r\n<li> <strong>Upgraded Chain</strong> &ndash; from Shimano Ultegra to SRAM Red</li>\r\n<li> <strong>Upgraded Wheelset</strong> &ndash; Mavic Ksyrium SL, which are lighter,stiffer, faster, and perform better</li>\r\n<li> <strong>Upgraded Brakes</strong> &ndash; from Shimano Ultegra to SRAM Red, which are lighter and smoother</li>\r\n<li> <strong>Upgraded Seatpost-&nbsp; </strong>The&nbsp; FSA K-force light seatpost  is one of the lightest on the market.&nbsp; It also completes the graphics  package complimenting the crank and handle bar.</li>\r\n</ol>\r\n<p>When you get a For&eacute; CR5, we custom fit it for you through our 23-Point  Custom Setup program. We&rsquo;ll get your specific&nbsp; body measurements so we  can outfit your bike to fit you perfectly.&nbsp; You\'ll have the rest of the  peloton envious of your ride.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
