	(131,'en','Catania','','','<p class=\"MsoPlainText\">The new Catania features carbon fork, carbon seatpost, Ultegra  derailleur, and the new Fezzari Racing Design R3A frame with increased  aerodynamic properties and a sleeker look.</p>\r\n<p class=\"MsoPlainText\">The Catania road bike is a great all-around bike. If you want to get  into road biking or want a bike that is durable, high-performing, and as  comfortable as a road bike can get, the Catania is for you.</p>\r\n<p class=\"MsoPlainText\">The Catania features the R3A frame with compact geometry. Compact  geometry means that we shorten the seat tube slightly, which makes the  bike a little lighter and reduces lateral flex (you don&rsquo;t want your bike  flexing side to side when you&rsquo;re pedaling). It also allows your riding  position to be a little more upright.</p>\r\n<p class=\"MsoPlainText\">Add to that a great set of components, including: Shimano Ultegra  derailleur and Shimano 105 shifters for smooth shifting Fezzari Carbon  II fork to minimize the road chatter; FSA Gossamer crank with external  oversized bearings that make it pedal smoother and more efficiently;  Alex double-wall rims that are extremely durable; Maxxis performance  tires; and a Fezzari Racing Design Ultra XR saddle that is one of the  most comfortable road saddles you&rsquo;ll ride.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(132,'en','Samsung Galaxy Player 5.0','','','<p>Easily connect via Wi-Fi without any monthly service fees. The Samsung Galaxy Player can access the internet and apps anywhere there is an available hotspot. The sleek, lightweight 6.42 oz. design fits in any pocket and the brilliant 5&rdquo; LCD delivers incredible viewing quality.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(133,'en','Samsung Galaxy Player 4.0','','','<p>Easily connect via Wi-Fi without any monthly service fees. The Samsung Galaxy Player can access the internet and apps anywhere there is an available hotspot. The sleek, lightweight 4.27 oz. design fits in any pocket and the brilliant 4&rdquo; Super Clear LCD delivers incredible viewing quality.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(134,'en','Creative ZEN Style M300 MP3 Player 16GB (Black)','','','<p>Don\'t let the compact appearance of the Creative ZEN Style M300 MP3 player fool you. For a media player this tiny, you&rsquo;d be amazed at the array of features it can offer for a remarkably affordable price.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(135,'en','Creative ZEN Touch 2 MP3 Player 8GB (Black)','','','<p>The ZEN line of portable media players has long been associated with the highest quality in audio playback, and the Creative ZEN Touch 2 continues to uphold this standard. But that\'s not all it offers. What makes this player truly stand out from the rest is that you can stream music wirelessly to compatible Bluetooth&reg; headphones or speakers such as Creative\'s ZiiSound D5 and WP-300, and surf the Internet too.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(136,'en','BlazBlue: Continuum Shift EXTEND','','','<p>\r\n<p>The Time of the AZURE is Here!</p>\r\n<p>&nbsp;</p>\r\n<p>Aksys Games, a publisher of interactive entertainment software, is proud to announce that the next installment in the hit fighting game series BlazBlue, BlazBlue: Continuum Shift EXTEND, will be coming to North America as a PlayStation&reg;Vita launch title! With the devious, all new playable character Relius Clover, new story scenarios, new gameplay modes, and competitively balanced action, BlazBlue: Continuum Shift EXTEND makes a grand return to home consoles and the new frontier!</p>\r\n<p>BlazBlue: Continuum Shift EXTEND Key Features:</p>\r\n<p>&nbsp;</p>\r\n<p>Enhanced Story Mode: Relive and rediscover the events that took place in BlazBlue: Calamity Trigger or venture forth into one of four all new story scenarios!</p>\r\n<p>New and Revised Game Modes to Explore: Take on the strongest of foes in Unlimited Mars Mode, dungeoneer your way to the bottom of Abyss Mode, or lead an army to victory in Legion Mode!</p>\r\n<p>Fully Revised Combat System: All characters, new and old, have been thoroughly rebalanced and armed with all new strategies and combos to take your game to the top!</p>\r\n<p>Improved Online Multiplayer: Battle it out in BlazBlue&rsquo;s acclaimed online mode with all new multiplayer features, such as online team battles!</p>\r\n<p>SHIP DATE: February 14, 2012</p>\r\n<p>GENRE: Fighting</p>\r\n<p>PLAYER(S): 1 Local, 2-6 Online</p>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(137,'en','Ultimate Marvel VS. Capcom® 3','','','<p>\r\n<p>he ULTIMATE heroes from Marvel and Capcom collide again in Ultimate Marvel vs. Capcom 3. Every epic character from the original blockbuster returns to the fray alongside 12 new fighters,&nbsp;</p>\r\n<p>8 over-the-top new stages and enhanced gameplay.</p>\r\n<p>COMING SOON: Ultimate Marvel Vs. Capcom 3 for PlayStation&reg;Vita system! It\'s the full console experience packed with 50 legendary characters*, local and Wi-Fi multiplayer, touch panel controls, and exclusive new features.</p>\r\n<p>UNLEASH YOUR ULTIMATE</p>\r\n<p>ANYTIME, ANYWHERE</p>\r\n<p>LAUNCHING with the PlayStation&reg;Vita system on 2/22/12&nbsp;</p>\r\n<p>OUT NOW on Xbox 360 and PlayStation&reg;3 system</p>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(138,'en','Ridge Racer','','','<p>\r\n<p>BEAUTY &amp; HIGH SPEED DRIFTING AROUND THE WORLD!</p>\r\n<p>The high-octane racing franchise drifts onto the PlayStation&reg;Vita delivering stunning graphics and heart-pounding action that players can truly feel. Ridge Racer&reg; features high-speed action, high-performance racing machines, and all-new gameplay additions creating an edge-of-your-seat experience only possible on the PlayStation&reg;Vita. Racing fans can also take the action online and tear up the track against players from around the globe using the PlayStation&reg;Vita &ldquo;near&rdquo; and Wi-Fi functionality and race against other players&rsquo; ghosts anywhere at anytime.</p>\r\n<p>\r\n<p>Vivid, next generation high-contrast graphics and advanced lighting effects powered by the PlayStation&reg;Vita painting processor</p>\r\n<p>An immersive audio experience with a dynamic soundscape that changes and evolves with each race according to the movement of your machine.</p>\r\n<p>All-new custom drift system enables players to tune the action to suit their style of driving. All new \"Machine Upgrade Map\" customization allows players to upgrade functional parts and create their own original machines</p>\r\n<p>New introduction of the Planetary League allows players to join in one of four racing teams and race against other players from around the world both at real-time and \"anywhere at any time\" by exchanging ghosts via \"near\" functionality.</p>\r\n<p>Compete against up to 7 other players from around the world with online (ad-hoc, Wi-Fi) multiplayer.</p>\r\n</p>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(139,'en','Shinobido 2: Revenge of Zen','','','<p>\r\n<p>Shinobido 2: Revenge of Zen is the sequel to Shinobido: Way of the Ninja, featuring the series&rsquo; trademark stealth action gameplay with the addition of new stylish assassin moves and a dynamic storyline. Developed by Acquire, the story is set six months after the events of the previous opus, with the Utakata region once again at the center of the storm and embroiled in a civil war involving the mysterious Magic Mirror. Players will take the role of Zen, a man who has suffered betrayal at the hands of his companions and the loss of his home. Saved by the Asuka clan of Utakata, Zen makes up his mind to live as an assassin and begins a perilous journey in search of revenge.</p>\r\n<p>Dynamic Storyline: Interact with three factions with different choices affecting the power balance between the factions and resulting in diverging storylines.</p>\r\n<p>Stealth action gameplay for a master assassin: Employ a variety of deadly finishing moves which vary according to the location. Activate the Zankoku for bullet-time action and use the Ninja Flying ability to freely explore environments.</p>\r\n<p>New &lsquo;near&rsquo; network features: Boost your inventory by receiving gift items from other players using the PlayStation&reg;Vita near feature.</p>\r\n<p>Original PS Vita rear touch panel gameplay features: &nbsp;Use the rear touch panel to change to a first person view and launch long range weapons at enemies.</p>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
