	(170,'en','588 Chrome Wedge','','','<p>The 588 Forged wedge maintains the popular, tour-proven shape of its  predecessor with a series of technological breakthroughs to provide even  more performance. Every wedge is Precision Forged from 1025 carbon  steel for incredibly soft, solid feel and the highest level of  manufacturing consistency for supreme confidence and trust over every  shot. Tour Zip Grooves&trade; and Laser Milled&trade; technology maximize spin in  accordance with USGA regulations. Exclusive to the 588 Forged wedge is  the Tour Concept Wedge steel shaft, co-developed and engineered by  Cleveland Golf and industry leader True Temper. With a unique stiffness  profile that features a less active tip, this shaft promotes a more  penetrating ball flight, increased spin and optimal distance control  along with superior feel. Choose from two different finishes &ndash; Satin and  Chrome &ndash; as well as low, standard and high bounce options.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(171,'en','Swingline™ Stack-and-Shred™ 100X Hands Free Shredder','','','<p>\r\n<p style=\"padding-top: 0px; padding-bottom: 10px; color: #424242; font-family: arial, verdana, sans-serif; font-size: 11px; margin: 0px;\">\r\n<h2 style=\"font-size: 13px; padding: 0px; margin: 0px;\"><span id=\"_ctl0_MainContent__ctl0_lblProdName\" style=\"padding: 0px; margin: 0px;\">Swingline&trade; Stack-and-Shred&trade; 100X Hands Free Shredder</span></h2>\r\n<p style=\"padding-top: 0px; padding-bottom: 10px; color: #424242; margin: 0px;\"><span id=\"_ctl0_MainContent__ctl0_lblWebCopy\" style=\"padding: 0px; margin: 0px;\">Experience the productivity of hands free shredding. The Swingline&trade; Stack-and-Shred&trade; shredder works without your supervision; just stack, shut and you\'re done. Stack up to 100 sheets for automatic shredding at home or in the office. Manual bypass handles 6 sheets of glossy, folded or crumpled paper.</span></p>\r\n<ul style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 15px;\">\r\n<span id=\"_ctl0_MainContent__ctl0_lblFeatBenefits\" style=\"padding: 0px; margin: 0px;\">\r\n<li style=\"list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;\">Hands free shredding-just stack, shut and you\'re done</li>\r\n<li style=\"list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;\">Auto+ jam clearance automatically reverses and re-feeds stuck papers to clear any jam. LED light indicates rare jams that require user action.</li>\r\n<li style=\"list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;\">Cross-cut shredder meets moderate security needs (Level 3)</li>\r\n<li style=\"list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;\">Shreds credit cards, paper clips, staples, documents into 7-gallon waste bin with view window</li>\r\n