	(177,'en','CG BLACK DRIVER','','','<p>With a sleek and striking look, the CG Black driver weighs only 265  grams, making it the lightest driver on the market to help players  generate measurable increases in swing speed and distance with the same  swing effort. The advanced aerodynamics found in the driver&rsquo;s Speed  Crown Design &ndash; an innovative, teardrop-inspired crown profile &ndash; maximize  distance by reducing drag at all angles of airflow during the swing.  MaxCOR2 Variable Face Thickness Technology reduces face weight and  increases trampoline effect on off-center hits, meaning higher ball  speed and more distance on off-center hits. Plus, a high-density weight  screw at the rear of the sole plate positions the center of gravity  lower and deeper to promote a high, draw-biased trajectory with optimal  launch conditions for effortless distance. The CG Black driver features a  Miyazaki C. Kua 39 Limited Edition graphite shaft and a Golf Pride  Ultralite grip, a combination that decreases overall club weight for  faster swing speed.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(178,'en','Wilson Jones® 364 Heavy Duty Round Ring Binder with Label Holder, 1\", Black','','','<p>\r\n<p class=\"body12\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #333333; font-size: 12px; text-align: left; text-decoration: none; font-family: Verdana, Arial, Helvetica, sans-serif; background-color: #ffffff;\"><span id=\"_ctl0_MainContent_lblDescription\">Built to last, this heavy duty binder with standard round rings is made of flexible polypropylene allowing it to fully protect your documents from the elements. The label holder on the binder spine is perfect for titling your projects.</span></p>\r\n<p class=\"body12\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #333333; font-size: 12px; text-align: left; text-decoration: none; font-family: Verdana, Arial, Helvetica, sans-serif; background-color: #ffffff;\"><span id=\"_ctl0_MainContent_lblFeatures\">&nbsp;</span></p>\r\n<ul style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; text-align: left; background-color: #ffffff;\">\r\n<li class=\"body12\" style=\"color: #333333; font-size: 12px; text-align: left; text-decoration: none;\">220 sheet capacity in 1 inch binder size</li>\r\n<li class=\"body12\" style=\"color: #333333; font-size: 12px; text-align: left; text-decoration: none;\">No-Gap round rings close tightly</li>\r\n<li class=\"body12\" style=\"color: #333333; font-size: 12px; text-align: left; text-decoration: none;\">Eco-friendly, PVC Free polypropylene material is virtually impossible to tear</li>\r\n<li class=\"body12\" style=\"color: #333333; font-size: 12px; text-align: left; text-decoration: none;\">100% recycled chipboard and 45% post consumer waste minimum recycled content</li>\r\n<li class=\"body12\" style=\"color: #333333; font-size: 12px; text-align: left; text-decoration: none;\">CleanView&trade; protection prevents ink from transferring off papers onto binder</li>