	(179,'en','CG16 Black Pearl Wedge','','','<div class=\"overviewbody\">\r\n<p>Based on the shape of the tour proven CG14<span style=\"font-size: 8pt;\">&trade;</span> wedge, the CG16<span style=\"font-size: 8pt;\">&trade;</span> has a hint of offset and is slightly larger for added forgiveness.&nbsp; The  face features the same spin maximizing technology featured on the CG15<span style=\"font-size: 8pt;\">&trade;</span> wedge &ndash; Tour Zip Grooves<span style=\"font-size: 8pt;\">&trade;</span> in combination with Cleveland<span style=\"font-size: 8pt;\">&reg;</span> Golf&rsquo;s breakthrough Laser Milled<span style=\"font-size: 8pt;\">&trade; </span>surface  roughness technology.&nbsp; Using the precision accuracy of a laser, each  face features four perfectly calibrated texture lines milled between  each groove exactly to the conforming roughness limit.&nbsp; This surface  roughness application optimizes ball-to-face friction and maximizes spin  within the Rules of Golf.</p>\r\n</div>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
