	(191,'en','Esperanza Spalding - Radio Music Society','','','<p>\r\n<p>THIS IS A PRE ORDER ITEM.</p>\r\n<p>IF PURCHASED, YOUR ITEM(S) WILL SHIP ON OR FOR DELIVERY ON MARCH 20, 2012</p>\r\n<p>&nbsp;</p>\r\n<p>ESPERANZA SPALDING RELEASES RADIO MUSIC SOCIETY,</p>\r\n<p>A KALEIDOSCOPIC COLLECTION CELEBRATING THE POWER OF SONG</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>CD With ADDED Value Download Card Card To Download 11 Music Videos</p>\r\n<p>&nbsp;</p>\r\n<p>&ldquo;Radio Song,&rdquo; the new disc&rsquo;s opening track, both sets the tone and confirms the aptness of Spalding&rsquo;s &ldquo;radio music&rdquo; metaphor. &ldquo;Everyone has the experience of turning on a car radio,&rdquo; she explains,&rdquo; mindlessly flipping through the dial and suddenly a fragment grabs you and you&rsquo;re totally digging it. I wanted to capture that moment when the music just sinks in. It&rsquo;s about the power of song, and how at the least it can save the day.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>Fleshing out the concept with original music was second nature to Spalding. &ldquo;I have this book of music that I&rsquo;ve written, and so much of it fit either the Chamber Music or Radio Music concept. Songs develop for me in fragments, so for these projects, I took my notes and organized them into coherent works of music.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>In the process, Spalding added her original, affirmative perspective to classic radio music themes. Songs about love run a full gamut. &ldquo;Hold On Me&rdquo; is a narrative of unrequited love, inspired by people who cling to dreams of relationships that can never be realized. &ldquo;Let Her,&rdquo; one of Spalding&rsquo;s older compositions, was inspired by &ldquo;different people I&rsquo;ve known who are in miserable situations, then complain when they end.&rdquo; &ldquo;Cinnamon Tree,&rdquo; written to cheer up a friend, celebrates platonic love, and Spalding&rsquo;s belief that &ldquo;the love between friends is just as important as romantic love.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>&ldquo;Crowned and Kissed,&rdquo; with references to King Arthur and Midas, is about &ldquo;the unsung royalty in your life, men and women who quietly, every day do the most honorable things, and who deserve to be honored even if they don&rsquo;t end up with castles and thrones.&rdquo; The edgy &ldquo;Smile Like That&rdquo; marks the moment a person realizes that his or her partner has developed other interests. &ldquo;I&rsquo;m saying, `Okay, I get it, let&rsquo;s not beat around the bush,&rdquo;&rsquo; Spalding explains.</p>\r\n<p>&nbsp;</p>\r\n<p>Her takes on the state of our country and our culture are equally fresh and insightful. &ldquo;Vague Suspicions&rdquo; confronts society&rsquo;s short attention span and our habit of absorbing horrific events and celebrity gossip as part of the same media overload. The brief &ldquo;Land Of The Free&rdquo; speaks to the sinister system of false imprisonment by outlining the case of one innocent victim who spent 30 years in jail for a crime he did not commit.</p>\r\n<p>&nbsp;</p>\r\n<p>&ldquo;Black Gold&rdquo; is specifically addressed to young boys of color. &ldquo;So much of our strength is drawn from resistance and endurance,&rdquo; she explains, &ldquo;but black pride didn&rsquo;t just start with the slave trade. I wanted to address our nobility, going back to our incredible ancestors in pre-colonial Africa. I remember meetings when I was in elementary school about being strong as young black women, and I don&rsquo;t think the boys had those meetings. This song is meant to speak to those young men, and I imagined it might one day be something that a parent could sing to his or her son.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>Radio Music Society also features &ldquo;City of Roses,&rdquo; a celebration of her native Portland, Oregon that Spalding was commissioned to write by Banana Republic, and two cover tunes. Taking the advice of one of her mentors, tenor saxophone giant Joe Lovano: &ldquo;When you do a classic, you have to find your own reason for doing it.&rdquo; Spalding charges Stevie Wonder&rsquo;s &ldquo;I Can&rsquo;t Help It&rdquo; with the energy of apprehensive new love and adds original lyrics to Wayne Shorter&rsquo;s &ldquo;Endangered Species&rdquo;.</p>\r\n<p>&nbsp;</p>\r\n<p>The music is realized by many of the brilliant musicians who are part of Spalding&rsquo;s ever-expanding universe. In addition to longtime partners Lovano, keyboard player Leo Genovese and drummer Terri Lyne Carrington, the ranks contain jazz legends Jack DeJohnette and Billy Hart; guitar heroes Jef Lee Johnson and Lionel Loueke; an array of master vocalists including Algebra Blessett, Lalah Hathaway, Gretchen Parlato, Leni Stern and Becca Stevens; hip-hop giant Q-Tip (who performs on and co-produced two tracks); and two Portland-based musicians, Janice Scroggins and Dr. Thara Memory, who provided essential mentorship in Spalding&rsquo;s youth.</p>\r\n<p>&nbsp;</p>\r\n<p>Four tracks feature the horn section of the American Music Program, a youth big band of musicians age 12 to 18 directed by her longtime mentor and teacher Dr. Memory, who conducts and provides horn arrangements; while the soulful pianist on &ldquo;Hold on Me&rdquo; is Ms. Scroggins, who Spalding studied with as a child. &ldquo;Both of them are phenomenal artists who aren&rsquo;t well known outside of the Northwest,&rdquo; Spalding emphasizes. &ldquo;Janice Scroggins was, quite honestly, too deep for me when I was eight years old. She unifies completely the sounds of gospel, blues and jazz, our American roots music. And Dr. Thara Memory, the teacher I came up through, has dedicated his life to spreading the message of this music. I had to have his youth band on the record, because they&rsquo;re part of my Music Society, too.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>Among its many strengths, Radio Music Society is a celebration of the men and women who have helped cultivate Spalding&rsquo;s talent, as well as those who have nurtured her vision and inspired her along the way. &ldquo;I&rsquo;ve had the honor and blessing of working with so many phenomenal jazz musicians over the years,&rdquo; she says. &ldquo;As I&rsquo;ve gotten to know them and their music, I&rsquo;ve grown to love them as family and colleagues. I wished for an opportunity for us all to interpret songs together, so that they can be heard and received by a larger audience. All my personal heroes who are revered in the jazz world &ndash; like Joe Lovano and Terri Lyne Carrington &ndash; should be heard by a mainstream audience, because what they manifest in their music is so beautiful, sincere and uplifting. I think they literally bring good into the lives of the people who hear them. So I&rsquo;ve tried to put together a program of music that speaks to the non-jazz listener, but can still provide a viable foundation for my jazz heroes to express themselves. Hopefully, people can enjoy all the elements of my music without being told which genres it is &lsquo;supposedly&rsquo; a blend of. Everyone is invited to listen with no pre-conceived notions. It&rsquo;s a journey. Think and feel for yourself. But, most importantly, ENJOY!&rdquo;</p>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
