	(195,'en','Crossroads Guitar Festival 2010 (2DVD)','','','<p>\r\n<p>2DVD edition of the 2010 Crossroads Guitar Festival. Featuring: Eric Clapton, Jeff Beck,Sheryl Crow,Vince Gill, Buddy Guy, B.B. King,John Mayer, Bill Murray,Steve Winwood,Ronnie Wood, ZZ Top,and more PLUS behind-the-scenes footage and interviews.</p>\r\n<p>&nbsp;</p>\r\n<p>DVD 1</p>\r\n<p>&nbsp;</p>\r\n<p>01 Promise Land - By Sonny Landreth with Eric Clapton</p>\r\n<p>02 Z. Rider - By Sonny Landreth with Eric Clapton</p>\r\n<p>03 Traveling Shoes - By Robert Randolph &amp; The Family Band</p>\r\n<p>04 Going Down - By Pino Daniele, Joe Bonamassa, Robert Randolph &amp; The Family Band</p>\r\n<p>05 Killing Floor - By Robert Cray with Jimmie Vaughan &amp; Hubert Sumlin</p>\r\n<p>06 Six Strings Down - By Jimmie Vaughan with Robert Cray &amp; Hubert Sumlin</p>\r\n<p>07 Waiting For The Bus - By ZZ Top</p>\r\n<p>08 Jesus Just Left Chicago - By ZZ Top</p>\r\n<p>09 Gypsy Blood - By Doyle Bramhall II</p>\r\n<p>10 In My Time Of Dying (Jesus Make Up My Dying Bed) - By Doyle Bramhall II</p>\r\n<p>11 Bright Lights - By Gary Clark Jr.</p>\r\n<p>12 Long Road Home - By Sheryl Crow with Derek Trucks, Susan Tedeschi, Doyle Bramhall II &amp; Gary Clark Jr.</p>\r\n<p>13 Our Love Is Fading - By Sheryl Crow with Eric Clapton, Doyle Bramhall II &amp; Gary Clark Jr.</p>\r\n<p>14 Blackwaterside - By Bert Jansch</p>\r\n<p>15 Mississippi Blues - By Stefan Grossman &amp; Keb\' Mo\'</p>\r\n<p>16 Roll And Tumble Blues - By Stefan Grossman</p>\r\n<p>17 One More Last Chance - By Vince Gill with Keb\' Mo\', James Burton, Earl Klugh &amp; Albert Lee</p>\r\n<p>18 Mystery Train - By Vince Gill with James Burton, Albert Lee, Keb\' Mo\' &amp; Earl Klugh</p>\r\n<p>19 Lay Down Sally - By Vince Gill with Sheryl Crow, Keb\' Mo\', Albert Lee, James Burton &amp; Earl Klugh</p>\r\n<p>20 Angelina - By Earl Klugh</p>\r\n<p>21 Vonetta - By Earl Klugh</p>\r\n<p>22 Who Did You Think I Was - By John Mayer Trio</p>\r\n<p>23 Ain\'t No Sunshine - By John