	(210,'en','HP Photosmart Plus e-All-in-One Printer - B210a','','','<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px; padding-bottom: 10px;\">Touch your way to easy, affordable printing with our Photosmart Plus e-All-in-One &ndash; B210a. You\'ll get affordable lab-quality photos, everyday documents, creative projects, and Web pages. Plus, HP<a class=\"udrline\" style=\"color: #003366; text-decoration: underline;\" href=\"http://www.hp.com/go/eprintbanner\" target=\"_blank\">ePrint</a><sup style=\"font-size: 0.8em;\">1</sup>and<a class=\"dotline\" style=\"color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;\">integrated wireless</a>will keep you connected on the go.<sup style=\"font-size: 0.8em;\">1, 2</sup></div>\r\n<div class=\"fl\" style=\"float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"><img style=\"border-style: initial; border-color: initial; padding: 0px; margin: 0px;\" src=\"http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/cn216a_right_facing.jpg\" alt=\"HP Photosmart Plus e-All-in-One - B210a, right facing image\" /></p>\r\n</div>\r\n<div class=\"col59pctL\" style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Easy and affordable</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Print photos and documents,</strong>make copies, and scan&mdash;all without turning on your PC</li>\r\n<li><strong>Get lab-quality,</strong>smudge-resistant photos that last<sup style=\"font-size: 0.8em;\">3</sup></li>\r\n<li><strong>Use the automatic photo tray</strong>tray for easy picture printing</li>\r\n<li>Share photos with friends<sup style=\"font-size: 0.8em;\">4</sup>via Snapfish</li>\r\n<li><strong>Have fun</strong>with photos using the included software</li>\r\n<li><strong>Print affordably</strong>with individual HP inks; save money with our high-capacity XL cartridges (sold separately) for frequent printing</li>\r\n<li><strong>Get templates</strong>for calendars and games with HP<a class=\"udrline\" style=\"color: #003366; text-decoration: underline;\" href=\"http://h71036.www7.hp.com/hho/us/en/ep/articles/quick-forms.html\" target=\"_blank\">Quick Forms</a><sup style=\"font-size: 0.8em;\">4</sup></li>\r\n</ul>\r\n</div>\r\n<div class=\"fl\" style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Quick Web printing, no PC</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Print from the Web without a PC</strong>&mdash;photos, coupons, recipes, greeting cards and more with customizable<a class=\"udrline\" style=\"color: #003366; text-decoration: underline;\" href=\"http://www.hp.com/go/eprintcenter\" target=\"_blank\">print apps</a><sup style=\"font-size: 0.8em;\">4</sup></li>\r\n<li><strong>Use the intuitive</strong>TouchSmart screen to make copies, photo reprints, and scans</li>\r\n<li><strong>Print and share</strong>from multiple PCs via the<a class=\"dotline\" style=\"color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;\">integrated wireless</a><sup style=\"font-size: 0.8em;\">2</sup></li>\r\n<li><strong>Just touch a button</strong>to print wirelessly<s