	(217,'en','ASUS CP6230','','','<p>The ASUS CP6230 features a space-saving design with a hexagonal pattern lid that easily fits anywhere in your home. It draws you in with its elegant aesthetics but holds your attention with its computer power to tackle any task.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(218,'en','ASUS Essentio CP1130','','','<p>The ASUS new Essentio CP1130 has sleek appearance and small size make it perfectly fit anywhere in your home. At the same time, it provides complete function and delivers ultimate performance for daily computing.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(219,'en','Series 3 15.6\" Laptop','','','<p>Don\'t be weighed down by wasted time, let your PC come alive when you need it. Your life happens on the go, you don\'t have time to wait for PC to shut down and power up. With Samsung\'s exclusive Fast Start technology, simply close the lid to enter a hybrid sleep mode. When you open the lid, you are up and running in less than 3 sec.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(220,'en','Series 7 Chronos 14” Notebook','','','<p>Cutting edge design: Sleek aluminum, a stunning screen, cutting edge performance, all seamlessly blended in one of the world&rsquo;s thinnest quad core PC.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(221,'en','Series 9 13.3\" Laptop','','','<p>You no longer have to shut down your Samsung computer, just close its lid and it goes into a special powerless sleep mode. When you open the lid your computer comes back to life in 3 seconds and you are exactly at the same place as when you shut the lid. Fast Start saves your data and system configurations to your hard drive and PC memory. So, when you power it back on it is just like you left it.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(222,'en','Series 3 15.6\" Laptop','','','<p>Don\'t be weighed down by wasted time, let your PC come alive when you need it. Your life happens on the go, you don\'t have time to wait for PC to shut down and power up. With Samsung\'s exclusive Fast Start technology, simply close the lid to enter a hybrid sleep mode. When you open the lid, you are up and running in less than 3 sec.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(223,'en','Samsung Galaxy Tab 8.9 (Wi-Fi Only) - 32GB Metallic Gray','','','<p>If you buy the wrong tablet, you&rsquo;re at the mercy of the manufacturer regarding how much you can customize or personalize your screens. But the beauty of Android is that you have much greater flexibility to arrange things however you want. You&rsquo;ll have multiple home screens to compose and design, plus live wallpapers to express your mood and personality. The Tab also offers you the freedom of TouchWiz&reg;, the intuitive user interface that allows you to quickly drag and drop your icons, widgets and Live Panels with only the touch of a finger. Now, reorganizing your tablet&rsquo;s menus and navigational options will be simple and straightforward.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(224,'en','Samsung Galaxy Tab™ 8.9 (AT&T)','','','<p>Your eyes have never seen such rich, luscious color. And at 1280x800, the resolution is well above normal HD standards. Of course, everything about the Tab is above normal.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(225,'en','Samsung Galaxy Tab™ 7.0\" (Verizon)','','','<p>The Samsung Galaxy Tab&trade; brings you the media you want and keeps you connected with anyone, anytime. Compact and light, you can keep in touch with people and content through 3G connectivity, Wi-Fi&reg; 802.11 b/g/n, Bluetooth&reg; Wireless Technology 3.0. With a battery life of up to seven hours* and a crisp TFT-LCD display, you&rsquo;re free to communicate, update, and enjoy.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(229,'en','HP 2711x 27\" LED Monitor','','','<p>\r\n<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px; padding-bottom: 10px;\">Maximize your home PC experience with our 2711x 27\" LED Monitor. You\'ll enjoy movies, photos, on-line<sup style=\"font-size: 0.8em;\">1</sup>games, and streamed shows on your PC in brilliant color on this ultra-slim, energy-saving monitor.</div>\r\n<div class=\"fl\" style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"><img style=\"border-style: initial; border-color: initial; padding: 0px; margin: 0px;\" src=\"http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/xp600aa_front_facing_left_cut.jpg\" alt=\"HP 2711x 27\" /></p>\r\n</div>\r\n<div class=\"col59pctL\" style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Superior technology</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Go ultra-slim:</strong>LED backlighting reduces the number and overall size of the components</li>\r\n<li><strong>See the detail:</strong>get deep blacks, brilliant color, and clarity with the ultra-high dynamic<a class=\"dotline\" style=\"color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;\">contrast ratio</a></li>\r\n<li><strong>Switch on/off</strong>faster than with a CCFL (standard) monitor</li>\r\n</ul>\r\n</div>\r\n<div class=\"fl\" style=\"float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font