	(13,'es','Your Idea, Inc. 12 Steps to Building a Million Dollar Business -- Starting Today!','','','<p style=\"text-align: left; color: #000000; font-size: 12px; background-color: #ffffff;\">\r\n	Every time a new story about how some nobody from nowhere got rich producing some clever new product in his garage, you may think, \"Why can\'t I do that?\" Well, anyone can--the trick is to take those good ideas and build them into great products that can succeed in the marketplace. In this book, you will get the 12-step plan you need to make your new product or service a profitable reality. You will learn important skills for success, including how to:\r\n</p>\r\n<ul style=\"text-align: left; color: #000000; font-size: 12px; background-color: #ffffff;\">\r\n	<li style=\"text-align: left;\">Refine their idea to attract a target audience</li>\r\n	<li style=\"text-align: left;\">Research the competition</li>\r\n	<li style=\"text-align: left;\">Find the right manufacturer</li>\r\n	<li style=\"text-align: left;\">Create appropriate brand messaging</li>\r\n	<li style=\"text-align: left;\">Build buzz online and beyond</li>\r\n	<li style=\"text-align: left;\">Work trade shows and conventions</li>\r\n</ul>\r\n<p>\r\n	<span style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">Written by a woman with no formal business experience who turned her own idea into a million-dollar company, this book is the pragmatic yet inspiring guide every aspiring entrepreneur is looking for.</span>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
