	(17,'es','101 Things Everyone Should Know About Economics A Down and Dirty Guide to Everything from Securities and Derivatives to Interest Rates and Hedge Funds—And What They Mean For You','','','<p><span style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">What you don\'t know about economics can hurt you&mdash;now more than ever. This easy-to-understand guide answers all the questions you need to know to secure your financial future, such as:</span></p>\r\n<ul style=\"text-align: left; color: #000000; font-size: 12px; background-color: #ffffff;\">\r\n<li style=\"text-align: left;\">What does it mean to my paycheck when the Fed lowers or raises interest rates?</li>\r\n<li style=\"text-align: left;\">What\'s the difference between bonds, securities, and derivatives&mdash;and which should I invest in now?</li>\r\n<li style=\"text-align: left;\">What does Keynesian economics have to do with my savings?</li>\r\n</ul>\r\n<p><span style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">For those people whose heads spin when reading the business pages of the newspaper, here\'s a roadmap through the economic jungle. In simple, plain language, Peter Sander explains how economies work, why they grow, how they contract, and what the government can and can\'t do to help them. Most important, he tells you how all this affects&nbsp;</span><em style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">you</em><span style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">&mdash;and what kind of changes you\'re going to see in your finances as a result.</span></p>\r\n<p style=\"text-align: left; color: #000000; font-size: 12px; background-color: #ffffff;\">Economics has been called the \"dismal\" science. But it doesn\'t need to be gloomy or impenetrable. This book is an essential guide for anyone who wants to understand where the economy is today, where it\'s going, and what it means for the rest of us.</p>\r\n<p>&nbsp;</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
