	(35,'es','Managing Enterprise Content: A Unified Content Strategy, 2nd Edition','','','<p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; line-height: 1.5em; color: #000000; font-family: \'Lucida Grande\', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff;\">We can\'t just design content for one channel, device or medium anymore; we need to design responsive structured content to reach customers anytime, anywhere, and on any device. And we can\'t do that until we can define how each element associated with a content object should be effectively written to respond to different customer needs and context of the content as well as changes in display and different capabilities of devices. This book presents a unified content strategy model.<br /><br />A unified content strategy:</p>\r\n<ul style=\"margin-top: 0px; margin-bottom: 1em; margin-left: 1.5em; color: #000000; font-family: \'Lucida Grande\', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff; padding: 0px;\">\r\n<li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; line-height: 1.5em;\">Identifies customer requirements</li>\r\n</ul>\r\n<ul style=\"margin-top: 0px; margin-bottom: 1em; margin-left: 1.5em; color: #000000; font-family: \'Lucida Grande\', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff; padding: 0px;\">\r\n<li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; line-height: 1.5em;\">Defines structured content models for responsive content</li>\r\n</ul>\r\n<ul style=\"margin-top: 0px; margin-bottom: 1em; margin-left: 1.5em; color: #000000; font-family: \'Lucida Grande\', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff; padding: 0px;\">\r\n<li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; line-height: 1.5em;\">Determines how content will be reused and repurposed across media and devices and how it will adapt to changing customer needs</li>\r\n</ul>\r\n<ul style=\"margin-top: 0px; margin-bottom: 1em; margin-left: 1.5em; color: #000000; font-family: \'Lucida Grande\', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff; padding: 0px;\">\r\n<li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; line-height: 1.5em;\">Identifies the tags (metadata) for retrieval and dynamic delivery</li>\r\n</ul>\r\n<ul style=\"margin-top: 0px; margin-bottom: 1em; margin-left: 1.5em; color: #000000; font-family: \'Lucida Grande\', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff; padding: 0px;\">\r\n<li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; line-height: 1.5em;\">Determines how content should be managed throughout the entire content lifecycle</li>\r\n</ul>\r\n<ul style=\"margin-top: 0px; margin-bottom: 1em; margin-left: 1.5em; color: #000000; font-family: \'Lucida Grande\', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff; padding: 0px;\">\r\n<li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; line-height: 1.5em;\">Defines the governance policies to manage the content from creation to retirement</li>\r\n</ul>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(36,'es','Routing Protocols and Concepts: CCNA Exploration Companion Guide','','','<p>&nbsp;</p>\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #000000; text-align: left; margin: 0px;\"><em>Routing Protocols and Concepts</em>, CCNA Exploration Companion Guide is the official supplemental textbook for the Routing Protocols and Concepts course in the Cisco Networking Academy&reg; CCNA&reg; Exploration curriculum version 4. This course describes the architecture, components, and operation of routers, and explains the principles of routing and the primary routing protocols. The Companion Guide, written and edited by Networking Academy instructors, is designed as a portable desk reference to use anytime, anywhere. The book&rsquo;s features reinforce the material in the course to help you focus on important concepts and organize your study time for exams.</p>\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #000000; text-align: left; margin: 0px;\">&nbsp;</p>\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #000000; text-align: left; margin: 0px;\">New and improved features help you study and succeed in this course:</p>\r\n<ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #000000; text-align: left;\">\r\n<li style=\"font-size: 1em;\">Chapter objectives&mdash;Review core concepts by answering the focus questions listed at the beginning of each chapter.</li>\r\n<li style=\"font-size: 1em;\">Key terms&mdash;Refer to the updated lists of networking vocabulary introduced and turn to the highlighted terms in context in each chapter.</li>\r\n<li style=\"font-size: 1em;\">Glossary&mdash;Consult the comprehensive glossary with more than 150 terms.</li>\r\n<li style=\"font-size: 1em;\">Check Your Understanding questions and answer key&mdash;Evaluate your readiness with the updated end-of-chapter questions that match the style of questions you see on the online course quizzes. The answer key explains each answer.</li>\r\n<li style=\"font-size: 1em;\">Challenge questions and activities&mdash;Strive to ace more challenging review questions and activities designed to prepare you for the complex styles of questions you might see on the CCNA exam. The answer key explains each answer.&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
