	(44,'es','U.S. History and Government, Second Edition','','','<p>\r\n<p style=\"color: #333333; font-family: Verdana, Geneva, sans-serif; font-size: 14px; line-height: 17px;\"><span style=\"color: #996633; font-family: Georgia, \'Times New Roman\', Times, serif; font-size: x-small;\"><strong>Purpose:</strong></span></p>\r\n<p style=\"color: #333333; font-family: Verdana, Geneva, sans-serif; font-size: 14px; line-height: 17px;\"><span style=\"color: #996633; font-family: Georgia, \'Times New Roman\', Times, serif; font-size: x-small;\">To provide students taking the 11th-grade New York State course in U.S. history and government and the Regents examination, as well as others taking a similar course, with a concise and comprehensive text.&nbsp;<br /></span></p>\r\n<ul style=\"color: #333333; font-family: Verdana, Geneva, sans-serif; font-size: 14px; line-height: 17px;\" type=\"square\">\r\n<span style=\"color: #996633; font-family: Georgia, \'Times New Roman\', Times, serif; font-size: x-small;\"><strong>Text features include:</strong>\r\n<li>introduction to U.S. geography with an emphasis on how geography has shaped the American experience</li>\r\n<li>summary of the founding, principles, and operations of the U.S. government . lucid historical narrative</li>\r\n<li>emphasis on the modern period</li>\r\n<li>primary source readings in every chapter</li>\r\n<li>emphasis on the experiences and contributions of women and minorities</li>\r\n<li>mid-chapter &ldquo;in Review&rdquo; features</li>\r\n<li>end-of-chapter exercises: multiple-choice, thematic-essay, and document-based questions</li>\r\n<li>more maps, charts, and tables</li>\r\n<li>expanded coverage of U.S. Supreme Court landmark cases</li>\r\n<li>&ldquo;The American People: Changes at the Millennium&rdquo; - a demographic feature in the last chapter</li>\r\n<li>appendix: annotated Declaration of Independence and U.S. Constitution.</li>\r\n<li>Teacher&rsquo;s Manual With Answers has guidelines for class presentation of each chapter, answer key, Student&rsquo;s Study Guide.</li>\r\n<li>Hardbound</li>\r\n</span>\r\n</ul>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(45,'es','The Process of Research in Psychology','','','<p><strong style=\"color: #000000; font-family: Arial, Verdana, \'Sans Serif\'; line-height: 15px; text-align: justify;\">A student friendly, thoughtfully organized introduction to research in psychology&nbsp;</strong><br style=\"color: #000000; font-family: Arial, Verdana, \'Sans Serif\'; line-height: 15px; text-align: justify;\" /><br style=\"color: #000000; font-family: Arial, Verdana, \'Sans Serif\'; line-height: 15px; text-align: justify;\" /><span style=\"color: #000000; font-family: Arial, Verdana, \'Sans Serif\'; line-height: 15px; text-align: justify;\">Employing numerous examples and the pedagogical approach of spaced repetition, this introductory text provides a step-by-step explanation of how to design, conduct, and present a research study in psychology. Chronologically organized and chock-full of pedagogy, this book creates logical scaffolding upon which students can build their knowledge.</span><br style=\"color: #000000; font-family: Arial, Verdana, \'Sans Serif\'; line-height: 15px; text-align: justify;\" /></p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
