	(48,'es','TS-MR2040','','','<p>This is marine audio at its best. This 8\" two-way speaker is built specifically for marine use, with heavy-duty construction that strenuously resists water, corrosion, heat&mdash;and boring music. Pioneer research showed that more bass is required for boating applications, and this 8\" size delivers.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(49,'es','TS-MR1640','','','<p>Whether you\'re out on the water or at the dock, this 6-1/2&rdquo; two-way speaker adds a new dimension to your boat. It\'s built specifically for marine use, with heavy-duty construction inside and out that strenuously resists water, corrosion, heat, and sunlight.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(50,'es','TS-D1720C','','','<p>Absolute fidelity to musical sources takes form from speakers that reproduce the ambience in which sounds originate. Stage size, musicians&rsquo; movement, aural reflection and other distinctive details all bring these sounds to life. Pioneer D-Series speakers are available in 2-way component packages or 2-way coaxial designs in multiple sizes that fit most vehicles.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(51,'es','TS-D6902R','','','<p>Absolute fidelity to musical sources takes form from speakers that reproduce the ambience in which sounds originate. Stage size, musicians&rsquo; movement, aural reflection and other distinctive details all bring these sounds to life. Pioneer D-Series speakers are available in 2-way component packages or 2-way coaxial designs in multiple sizes that fit most vehicles.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(52,'es','KFC-W3013PS','','','<p>1200W Peak Power<br /> 400W RMS Power<br /> 4 ohms Impedance<br /> 34Hz - 300Hz Frequency Response<br /> 6\" Mounting Depth<br /> PP Cone with Diamond Array Pattern<br /> Dual-Ventilation System<br /> Rubber Surround</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(53,'es','KFC-W3012','','','<p>Super-sturdy, super powerful, the KFC-W3012 is a 12-inch, 4-ohm sub that handles an impressive 1200W of power. A truly high-performance sub, the KFC-W3012 has a long stroke design and a silver textured pattern cone woofer that adds strength and rigidity to the cone for maximum bass performance.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(54,'es','TS-W3002D2|D4','','','<p>The TS-W3002D2/4 subwoofers are designed to produce enormously powerful music. Just take a look at its super-heavy-duty construction, all designed to handle up to 3,500 watts max. Double-stacked magnets for higher power, and a step-up radial surround for superior control and long excursions. We used a constructed cast-aluminum basket for this sub. Add in our patented IMPP cone and you\'ve got a monster sub that can handle whatever you want to throw at it.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(55,'es','PRS-D800','','','<p>The PRS-D800 2-channel amplifier contains audiophile grade components that were carefully selected and design perfected to achieve highest audio quality.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(56,'es','GM-6500F','','','<p>From dramatic distinction to dramatic design, Pioneer\'s new GM-Series amplifiers are thrillers in every sense, pushing the limits of flexibility and functionality.<br /><br />The 4-channel GM-6500F delivers a whopping 760 watts max - plenty of juice to power your speakers. It\'s also got built-in low-pass/high-pass crossovers, speaker level inputs for easy connection to an OEM headunit and oversized power terminals.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(57,'es','GM-D8500M','','','<p>Class-D amplifiers overcome the inefficiencies of traditional Class-A or AB amplifiers. Pioneer&rsquo;s Class-D amps transform very little power into heat so a higher percentage of the power supply (67%) is transformed into the load. This results in a very compact amp which needs less input power to produce very high output power. The Class-D amplifier&rsquo;s PWM (Pulse Width Modulator) modulates the original audio input signal with a triangulated signal wave which has a much higher fixed frequency. The result is a digital signal which contains both the input signal and a band of frequency components around the modulation frequency. A LPF (Low Pass Filter) then filters out the high frequency pulses and the resulting amplified output signal is then sent to the subwoofer and/or speakers.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(58,'es','AVH-P8400BH','','','<p>The AVH-P8400BH is Pioneer\'s top-of-the-line DVD multimedia receiver that features a beautiful 7\" motorized touchscreen interface with our new Advanced Display Resolution technology, built-in Bluetooth&reg; for hands-free calling and audio streaming, an HD Radio&trade; tuner, and Advanced App Mode for iPhone&reg; 4/4S. The newly designed and innovative user interface makes direct operation of the unit stress-free by eliminating complicated layered selection displays, so access to desired functions is smoother and simpler than ever. A variety of multimedia options ensures that you will be properly entertained. Customizable audio and video functions make it easy to suit your mood.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(59,'es','AVH-P4400BH','','','<p>The AVH-P4400BH DVD multimedia receiver features a 7\" motorized touchscreen display, built-in Bluetooth&reg; for hands-free calling and audio streaming, and an HD Radio&trade; tuner. The newly updated and innovative user interface makes direct operation of the unit stress-free by eliminating complicated layered selection displays, so access to desired functions is smoother and simpler than ever. A variety of multimedia options ensures that you will be properly entertained. Customizable audio and video functions make it easy to suit your mood.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(60,'es','AVIC-Z130BT','','','<p>Pioneer\'s flagship navigation receiver, the double-DIN AVIC-Z130BT features built-in navigation with maps of the US, Alaska, Hawaii, Canada, and Puerto Rico. Get there fast with spoken street names, lane guidance, and a wealth of GPS features, and stay in touch on the way with built-in Bluetooth for hands-free calling. The motorized 7-inch WVGA touchscreen display is great for GPS and for navigating your entertainment, whether it\'s DVDs or CDs, your digital media from USB drives or microSD cards, or content from your iPhone. Speaking of iPhones, the AVIC-Z130BT features enhanced integration with Pandora and Aha Radio apps, along with GPS features through the free AVIC FEEDS app.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(62,'es','XRS 9945','','','<p>The XRS 9945 provides total protection and peace of mind with Super-Xtreme Range Superheterodyne&trade; Technology, detecting all 15 radar/laser bands with its super-fast lock-on detection circuitry. The unit provides extra detection range and the best possible advance warning to even the fastest of POP mode radar guns. Other features include Cobra exclusive full-color ExtremeBright DataGrafix&reg; Display, an 8-point electronic compass, Voice Alert&trade;, car battery voltage display/low car battery warning and much more.<br /><br /> With the optional GPS Locator and AURA&trade; Database, upgrade your unit to alert you to verified Speed and Red Light Camera locations, dangerous intersections, and reported Speed Trap locations for entire United States and Canada (purchase and subscription necessary).</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(63,'es','XRS 9770','','','<p>The XRS 9770 provides total protection and peace of mind with Xtreme Range Superheterodyne Technology, detecting all 15 radar/laser bands with its completely new, super-fast lock-on detection circuitry. The unit provides extra detection range and the best possible advance warning to even the fastest of POP mode radar guns. Other features include DigiView&reg; Text Display, an 8-point electronic compass, Voice Alert, and much more.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(64,'es','XRS 9745','','','<p>The XRS 9745 provides total protection and peace of mind with Xtreme Range Superheterodyne&reg; Technology, detecting all 15 radar/laser bands with its super-fast lock-on detection circuitry. The unit provides extra detection range and the best possible advance warning to even the fastest of POP mode radar guns. Other features include DigiView&reg; Text Display, an 8-point electronic compass, Voice Alert&trade;, and much more.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(65,'es','XRS 9370','','','<p>The XRS 9370 provides total protection and peace of mind with the Xtreme Range Superheterodyne technology, detecting all 14 radar/laser bands at greater range than its predecessor. It comes in an industry-leading compact design with UltraBright&trade; Data Display, LaserEye&reg;, and much more.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(66,'es','XRS 9970G','','','<p>The XRS 9970G provides total protection and peace of mind with Super-Xtreme Range Superheterodyne Technology, detecting all 15 radar/laser bands with its super-fast lock-on detection circuitry. The unit provides extra detection range and the best possible advance warning to even the fastest of POP mode radar guns. . It comes with a GPS Locator and Lifetime updates to the AURA&trade; Database to alert you to verified Speed and Red Light Camera locations, dangerous intersections, and reported Speed Trap locations for entire United States and Canada.  Other features include Cobra exclusive Touchscreen, full-color ExtremeBright DataGrafix Display, an 8-point electronic compass, Voice Alert, car battery voltage display/low car battery warning and much more.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(67,'es','HTC Wildfire S - White (T-Mobile)','','','<p>The HTC Wildfire S for T-Mobile is a 3G capable smartphone that adds style to a practical device. This sleek device runs on the Android&trade; 2.3 platform, so you can have the latest Android&trade; technology and access to thousands of apps. It also features a 3.2 inch capacitive touchscreen, a 5 megapixel camera for capturing important moments and Wi-Fi calling/hotspot capabilities! Weighing only 3.7 ounces, the Wildfire S is extremely portable. If you are looking for a stylish and fun smartphone that is easy to use, the HTC Wildfire S could be the phone for you!</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(68,'es','Titan','','','<p>In the right hands, amazing things happen.<br /><br />Put emails in their place<br /> Combine your personal inboxes while keeping your work account separate.<br /><br />Plenty of room in the office<br /> Microsoft&reg; Office Mobile and multitasking on a huge <br /> 4.7\" screen makes plenty of room for work, wherever you go.<br /><br />Focus on thoughts, not thumbs<br /> With such a spacious keypad, you can stop focusing on your fingers and start focusing on ideas.<br /><br />Expansive display, infinite possibility<br /> Whether you&rsquo;re taking care of business or taking a break from it all, you can see the big picture on the 4.7\" LCD screen.<br /><br />Pocket-sized profile<br /> At 9.9mm, it&rsquo;s slim enough to fit comfortably in your pocket. But considering everything the HTC TITAN with Windows Phone is capable of, it won&rsquo;t be spending much time there.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(69,'es','Rhyme','','','<p>HTC Rhyme&trade; and its suite of innovative accessories<br /> deliver seamless experiences.<br /><br />Docking Station<br />Effortlessly slide the HTC Rhyme into the Docking Station to charge it and automatically activate Dock Mode, turning your phone into an all-in-one alarm clock, music player, and picture frame.<br /><br /> Charm<br /> Attached to your bag, the Charm alerts you of calls, missed calls, and messages. It also keeps your phone within easy reach and goes with anything.<br /><br /> Tangle&ndash;free Headphones<br /> These headphones don&rsquo;t just sound amazing&mdash;they&rsquo;re virtually tangle-free, thanks to flat wires.<br /><br />Exclusive HTC Sense&trade; experience<br /> The HTC Rhyme delivers a visually refined and intuitive <br /> HTC Sense experience. Find what you want faster with streamlined menus across HTC Sense apps and get the live info you care about on the home screen with the Quick Launch widget. Stay on top of all your to-dos by creating tasks from emails and messages, then sync those tasks with your Microsoft&reg; Exchange account for one to-do list on phone and PC.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(70,'es','EVO Design 4G','','','<p>The HTC EVO Design 4G is a high-end smartphone that is packed full of the latest features! Powered by Android 2.3, this device comes pre-loaded with the newest Android Platform for smartphones. You can choose from thousands of apps and games at the Android Marketplace. The HTC EVO Design 4G also comes loaded with a 4.0&rdquo; qHD capacitive touch display, with the latest version of HTC Sense, and international phone capabilities. With a 5 megapixel main camera, you will have the ability to capture, record and playback in HD. This smartphone also features a 1.3 megapixel front-facing camera for video chats! Quickly download movies and create user generated content with a flash-enabled web browsing experience running on Sprint\'s 4G network and the power of a 1.2 GHz processor.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(71,'es','DROID INCREDIBLE 2','','','<p>Socialize with a sense of style<br /> The Droid Incredible 2 by HTC is ready to party. Its sleek, all-black design will get looks, and front and back cameras can help capture a scene, start a conversation, or snap a self-portrait. You can record the night\'s most memorable moments in 720p HD video for sharing later.<br /><br />A phone that\'s designed around you<br /> HTC Sense&trade; lets you do more in fewer steps with a friendly experience that brings everything you care about right to the surface. You can easily make your phone your own and put everything exactly where you want it. FriendStream&trade; pulls together all your friends\' Twitter,&trade; Facebook,&reg; and Flickr&reg; updates in one place. Here\'s an idea: Choose a People widget that lets you see everybody\'s latest updates and messages right on the home screen. You can also select a compact People widget that just shows their profile pictures.<br /><br />Worth watching &mdash; and listening to<br /> Your music and movies look and sound great on a 4-inch super LCD screen with SRS WOW&trade; HD surround sound. Get access to unlimited songs through V CAST&trade; Music with Rhapsody or tune in to the expert DJs on Slacker&reg; Internet Radio. V CAST Video on Demand gives you on-the-go access to more shows and movies, including those available from BLOCKBUSTER On Demand.&reg;<br /><br />Invite friends to your own private Hotspot<br /> Your phone turns into a 3G Mobile Hotspot, for up to five other Wi-Fi&reg;&ndash;enabled devices. That just might make you more popular than ever.<br /><br />Call anyone, anywhere &mdash; no matter where you travel<br /> The global-ready Droid Incredible 2 by HTC will keep you connected from Lima to London.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(72,'es','DROID RAZR','','','<p>DESIGN: THINNEST 4G LTE SMARTPHONE<br />DROID RAZR is so thin, it makes microchips feel flabby. The thinnest 4G LTE smartphone, it can get you out of the tightest of situations while letting you keep your cool.<br /><br />CONSTRUCTION: DROID STRONG, RAZR SHARP<br />DROID RAZR proves that thin no longer equals frail. It\'\'s made strong with KEVLAR&reg; fiber, while Corning&reg; Gorilla&reg; Glass defends the screen against scrapes and scratches. A force field of water-repellent nanoparticles shields the phone against water attacks - even the electrical boards inside.<br /><br />NETWORK SPEED: DOMINATE AT WARP SPEED<br />Unleash the fierce power of Verizon\'s 4G LTE network, piloted by a dual-core 1.2 GHz processor. Blast your music and check the score, while email reloads - all at the same time, without delay. The 1 GB of RAM keeps you rocketing through.<br /><br />DUAL CAMERAS: LIFE HAS NEVER LOOKED BETTER<br />Create some cinematic awesomeness of your own with an 8MP rear camera and 1080p HD video recording. Ready for all conditions, DROID RAZR has image stabilization technology for less blurry video.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>');
INSERT INTO `cscart_product_descriptions` (`product_id`, `lang_code`, `product`, `shortname`, `short_description`, `full_description`, `meta_keywords`, `meta_description`, `search_words`, `page_title`, `age_warning_message`, `promo_text`)
VALUES
	(73,'es','DROID BIONIC','','','<p>With a ferociously fast Verizon Wireless 4G LTE network and dual-core 1 GHz processor, DROID BIONIC is the master of all Droids. And with ZumoCast&trade; by Motorola, nothing is beyond your digital reach. The free app lets you pull your music, movies, pictures and documents from your computer like a digital telepath - instantly and wirelessly. That\'s right, DROID BIONIC is so powerful, it can control your connected devices and extract their precious content, remotely, at 4G LTE speed. That makes it not only the master of all Droids, but the master of machines.<br /><br />Key Features:<br /> Our free Zumocast&trade; app lets you stream content 24/7 and in real time from your computer <br /> 4G LTE speeds up to 10x faster than 3G to stream movies, watch TV and video chat <br /> Crisp text, vivid imagery and brilliant color delivered in 4.3-inch high res qHD <br /> Doubles as a 4G LTE mobile hotspot for up to 5 Wi-Fi enabled devices <br /> Dual-core 1GHz processor and 1GB RAM <br /> Webtop app transforms your phone; surf the web, run apps and take calls - all at the same time <br />In The Box:<br /> DROID BIONIC phone<br />HW4X Standard Battery<br /> Standard Battery Door<br />Travel Charger<br />Micro USB Data cable<br /> User Guide</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(74,'es','Droid 3','','','<p>You\'re going places, and DROID 3 by Motorola can take you there. With incredible dual-core speed and brilliant qHD display. You\'re making a big Android smartphone statement. DROID 3 offers more power and greater responsiveness, and the efficient handling of a five-row keyboard. The thinnest full QWERTY smartphone. Ever.<br /><br />Key Features: <br />Adobe&reg; Flash&reg; Player for stellar video and gaming<br />Scratch-resistant Corning&reg; Gorilla&reg; Glass with glare reducing coating<br />View, capture and share on the large 4-inch qHD display<br />An 8MP camera with 1080p HD video and front-facing web cam to see and be seen<br />Video capture in 1080p HD; output to compatible device via HDMI&reg; micro connector cable<br />Thinnest Full QWERTY smartphone ever.<br /> Super-charged dual-core 1GHz processor makes multi-tasking a snap<br /> What you get in the box: <br />DROID 3 phone <br />Battery Door <br />Battery <br />Charger <br />User Guide</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(75,'es','DROID PRO','','','<p>Access your work directory, email or calendar with Droid Pro by Motorola, an Android-for-business smartphone with corporate-level-security. It features both a QWERTY keyboard and touchscreen, a speedy 1 GHZ processor and Adobe&reg; Flash&reg; Player 10.<br /><br /> Key Features: <br /> Up to 2GB memory on board, 2GB microSD pre-installed, expandable up to 34GB <br /> 5MP camera with auto focus and dual-LED flash <br /> Touchscreen navigation, pinch to zoom and customized home screens <br /> CDMA plus quad-band GSM and tri-band UTMS <br /> Ultra-fast 1 GHz processor for better web browsing and speedy UI and downloads <br /> Android 2.2 (Froyo) Platform <br /> Mobile Email: IMAP and POP, Microsoft Exchange, Gmail&trade;, MSN Hotmail&reg;, Yahoo!&reg; and AOL&reg; <br /> Quickoffice&reg;, Skype mobile&trade;, YouTube, AuthenTec VPN client, Mediashare, File Manager <br /> Be a mobile hot spot for up to 5 other devices <br /> Adobe&reg; Flash&reg; Player 10 <br />What you get: <br /> DROID PRO by Motorola phone <br /> Battery <br /> Battery Door <br /> Travel Charger <br /> User Guide</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(76,'es','FLIPSIDE with MOTOBLUR','','','<p>MOTOROLA FLIPSIDE&trade; is a powerhouse at work or play, with enhanced MOTOBLUR to not only sync social media, but now to help prioritize - with content filters and resizable widgets to keep you on track.<br /><br /> Key Features: <br />Use Global Address Lookup to access corporate directions and easily schedule meetings on the go <br /> Touchscreen supports pinch-to-zoom or slide open for QWERTY keyboard and laptop-like nav pad <br /> Extend time between charges as MOTOBLUR battery manager monitors power consumption <br />Prioritize home screen messages using MOTOBLUR filters and resizable widgets <br />CrystalTalk&trade; PLUS technology amplifies your voice and filters out background noise <br />Facebook&trade;, MySpace and Twitter Direct Messaging <br />What you get in the box:: <br />FLIPSIDE&trade; with MOTOBLUR&trade; for AT&amp;T phone <br /> Battery BT61 <br /> Battery Door <br />Travel Charger <br /> User Guide</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(117,'es','SCH-I515','','','<p>Galaxy Nexus is the world\'s first phone with a 4.65\" high-definition  Super AMOLED display, making text, photos, videos and games look crisp,  vibrant and rich. With 1280x720 HD resolution, videos look amazing and  the unique Contour Display curves nicely to the shape of your face and  makes it easier to hold.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(118,'es','Smallville: The Complete Tenth Season','','','<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Screen Aspect: 16 X 9 FULL FRAME</p>\r\n<p>Run Time: 1012 minutes</p>\r\n<p>Episodes Info :</p>\r\n<p>Lazarus</p>\r\n<p>Shield</p>\r\n<p>Supergirl</p>\r\n<p>Homecoming</p>\r\n<p>Isis</p>\r\n<p>Harvest</p>\r\n<p>Ambush</p>\r\n<p>Abandoned</p>\r\n<p>Patriot</p>\r\n<p>Luthor</p>\r\n<p>Icarus</p>\r\n<p>Collateral</p>\r\n<p>Beacon</p>\r\n<p>Masquerade</p>\r\n<p>Fortune</p>\r\n<p>Scion</p>\r\n<p>Kent</p>\r\n<p>Booster</p>\r\n<p>Dominion</p>\r\n<p>Prophecy</p>\r\n<p>Finale Part 1</p>\r\n<p>Finale Part 2</p>\r\n<p>Special Features:</p>\r\n<p>Commentaries on 2 Key Episodes</p>\r\n<p>Unaired Scenes</p>\r\n<p>Smallville: Coming Home: Cast and Creators Reflect on the Landmark 200th Episode Homecoming, in Which Clark Kent Experiences</p>\r\n<p>Transformative Events on the Way to His Final Destiny</p>\r\n<p>My Fathers, My Son: How Clark Kent&rsquo;s Fathers/Son Relationships Evolved over the Series&rsquo; 10 Years</p>\r\n<p>How Do We Do Music Video</p>\r\n<p>Media Quantity: Multi D</p>\r\n<p>Packaging Type: VIVA 6 Disc 25mm Case</p>\r\n<p>Subtitle Languages:</p>\r\n<p>Chinese</p>\r\n<p>French</p>\r\n<p>Portuguese</p>\r\n<p>Spanish</p>\r\n<p>Copyright:</p>\r\n<p>SMALLVILLE and all related characters and elements are trademarks of and &copy; DC Comics.</p>\r\n<p>Genre: Drama, Television</p>\r\n<p>Synopsis:</p>\r\n<p>The series that redefines the origins of the world&rsquo;s greatest hero reaches its powerful conclusion with more revelations, more fascinating characters from DC Comics lore and a mind-blowing, spirit-lifting finale that is everything fans could want. In this 22-Episode Season 10, super heroes emerge from the shadows, only to be driven underground by a public that labels them vigilantes. At the same time, otherworld forces of darkness gather, presenting Clark Kent with the greatest challenge of his young life. The world he calls home and the people he loves &ndash; including Lois Lane, who now shares his secret and his life &ndash; need a champion. They shall have one. Don&rsquo;t miss all the hopes, heartaches and heroics of a final season to remember. They will lift you up, up and away.</p>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
