	(97,'es','Harry Potter and the Deathly Hallows - Part 2 (Blu-ray+DVD+UltraViolet Digital Copy Combo Pack)','','','<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Theatrical Release Date: 07/14/2011</p>\r\n<p>Special Features:</p>\r\n<p>- Disc 1 (Blu-ray): Feature Film and Maximum Movie Mode</p>\r\n<p>- Disc 2 (Blu-ray): Special Features</p>\r\n<p>- Disc 3: (DVD): Standard definition version of the film Also includes an UltraViolet Digital Copy for Instant Streaming (redeemed</p>\r\n<p>via in-packed insert)</p>\r\n<p>&nbsp;</p>\r\n<p>&bull; Maximum Movie Mode hosted by Matthew Lewis (Neville Longbottom) and other cast members - As the epic showdown between Harry</p>\r\n<p>Potter and Lord Voldemort approaches, don&rsquo;t miss a single detail as the forces of Good and Evil clash one final time throughout the</p>\r\n<p>grounds of Hogwarts.</p>\r\n<p>&bull; A Conversation with JK Rowling and Daniel Radcliffe - Join J.K. Rowling and Daniel Radcliffe for an exclusive conversation</p>\r\n<p>about bringing the character of Harry Potter to life, the last decade of films and how their lives have changed by the fame that</p>\r\n<p>they&rsquo;ve both experienced.</p>\r\n<p>&bull; The Goblins of Gringotts - Hosted by Warwick Davis, you&rsquo;ll see the entire process of becoming a goblin&rdquo; on a Harry Potter</p>\r\n<p>film, from auditions and casting to makeup and prosthetic tests as well as filming the final scenes.</p>\r\n<p>&bull; The Women of Harry Potter &ndash; A look at the remarkable women in Harry Potter&rsquo;s life and the critical role they play in the</p>\r\n<p>films.</p>\r\n<p>&bull; Warner Bros. Leavesden Studios Sneak Peek</p>\r\n<p>&bull; Deleted Scenes&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Packaging Type: O-Sleeve 3-disc Elite BD Case</p>\r\n<p>Copyright:</p>\r\n<p>&copy; 2011 Warner Bros. Ent. Harry Potter Publishing Rights &copy; J.K.R. Harry Potter characters, names and related indicia are trademarks of and &copy; Warner Bros. Ent. All Rights Reserved.</p>\r\n<p>Ge