	(129,'es','Fore CR1','','','<p>Take your riding to the next level with the For&eacute; CR1 full carbon road  bike, built to be extremely durable and responsive. Feel the adrenalin  rush as it accelerates smoothly and corners aggressively. Great for  cross-country riding, a triathlon, and even a race.&nbsp; The new Fezzari  Fore CR1 is the newest bike to the Fezzari carbon road bike family.&nbsp; It  has the same tried and true monocoque carbon frame as the&nbsp; Fore CR2, but  is built with a Shimano 105/Ultegra groupo to help save a little on the  price.</p>\r\n<p>Start with a proprietary Fezzari Racing Design Xr4 monocoque carbon  frame that was recently tested as one of the most durable frames on the  market.</p>\r\n<p>All this translates into exhilaration when you&rsquo;re climbing &ndash; knowing  that you&rsquo;re ascending more efficiently &ndash; and confidence on the downhill  when you take that corner at high speeds. Our proprietrary frame  painting process give one of the best looking finishes available.</p>\r\n<p>You get e&nbsp; upgrades over the Catania:</p>\r\n<ol>\r\n<li> <strong>Upgraded Frame</strong> &ndash; the CR1 has a full monocoque carbon  frame vs the Catania&rsquo;s aluminum alloy frame. The carbon frame is lighter  and will absorb more of the road chatter when riding.</li>\r\n<li> <strong>Upgraded Seatpost</strong> &ndash; the larger diameter 31.6mm seatpost is stiffer and lighter.</li>\r\n<li> <strong>Upgraded Wheels</strong> &ndash; The CR1 gets a lighter and more aero dynamic wheel whith looks to go with it.</li>\r\n</ol>\r\n<p>Who will want this bike? If you&rsquo;ve been biking and plan to get into it  more, and you want to get something that will grow with you as you grow  in the sport (but you&rsquo;re not willing to pay the price of a CR3 or CR5),  then this is the bike for you. It gets you on a full monocoque carbon  fiber frame and still gives you the confidence you won\'t miss a shift  with the Shimano 105/Ultegra drivetrain. You&rsquo;ll have the confidence that  you can ride with anyone, anytime.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
