	(170,'es','588 Chrome Wedge','','','<p>The 588 Forged wedge maintains the popular, tour-proven shape of its  predecessor with a series of technological breakthroughs to provide even  more performance. Every wedge is Precision Forged from 1025 carbon  steel for incredibly soft, solid feel and the highest level of  manufacturing consistency for supreme confidence and trust over every  shot. Tour Zip Grooves&trade; and Laser Milled&trade; technology maximize spin in  accordance with USGA regulations. Exclusive to the 588 Forged wedge is  the Tour Concept Wedge steel shaft, co-developed and engineered by  Cleveland Golf and industry leader True Temper. With a unique stiffness  profile that features a less active tip, this shaft promotes a more  penetrating ball flight, increased spin and optimal distance control  along with superior feel. Choose from two different finishes &ndash; Satin and  Chrome &ndash; as well as low, standard and high bounce options.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
