	(176,'es','Quartet® Euro™ Magnetic Porcelain Total Erase® Mobile Easel','','','<p>\r\n<p class=\"prod16bold\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #333333; font-weight: bold; font-size: 16px; text-align: left; text-decoration: none; font-family: Verdana, Arial, Helvetica, sans-serif; background-color: #ffffff;\"><span id=\"_ctl0_MainContent_lblTitle\">Quartet&reg; Euro&trade; Magnetic Porcelain Total Erase&reg; Mobile Easel</span></p>\r\n<p class=\"body12\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #333333; font-size: 12px; text-align: left; text-decoration: none; font-family: Verdana, Arial, Helvetica, sans-serif; background-color: #ffffff;\"><span id=\"_ctl0_MainContent_lblDescription\">Ultra-durable, ultra-smooth 27\" x 41\" mobile presentation easel with DuraMax&reg; porcelain surface that will not scratch, dent, stain or ghost. Delivers superior performance when collaboration is needed in high-profile, heavy-use office environments. Magnetic surface doubles as bulletin board. Easy-to-clean writing surface requires minimal use of Quartet&reg; cleaning solutions. Adjustable hooks and clamp hold standard-sized flipcharts for easy sheet tear-away meeting notes. Smooth-rolling 5-caster star-base wheels lock firmly in place for total control and mobility. Flexible spring-loaded height adjuster moves from 67\" to 77\" for optimal height. Includes spacious folding accessory tray and 4 assorted Quartet&reg; whiteboard markers. Sleek Euro&trade; design with matte aluminum finish for maximum style and durability. 100% Satisfaction Guaranteed.</span></p>\r\n<p class=\"body12\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #333333; font-size: 12px; text-align: left; text-decoration: none; font-family: Verdana, Arial, Helvetica, sans-serif; background-color: #ffffff;\"><span id=\"_ctl0_MainContent_lblFeatures\">&nbsp;</span></p>\r\