	(177,'es','CG BLACK DRIVER','','','<p>With a sleek and striking look, the CG Black driver weighs only 265  grams, making it the lightest driver on the market to help players  generate measurable increases in swing speed and distance with the same  swing effort. The advanced aerodynamics found in the driver&rsquo;s Speed  Crown Design &ndash; an innovative, teardrop-inspired crown profile &ndash; maximize  distance by reducing drag at all angles of airflow during the swing.  MaxCOR2 Variable Face Thickness Technology reduces face weight and  increases trampoline effect on off-center hits, meaning higher ball  speed and more distance on off-center hits. Plus, a high-density weight  screw at the rear of the sole plate positions the center of gravity  lower and deeper to promote a high, draw-biased trajectory with optimal  launch conditions for effortless distance. The CG Black driver features a  Miyazaki C. Kua 39 Limited Edition graphite shaft and a Golf Pride  Ultralite grip, a combination that decreases overall club weight for  faster swing speed.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
