	(200,'es','John Rutter - The Colours of Christmas','','','<p>\r\n<p>The Colours of Christmas is a collection of the greatest Christmas carols by the composer/conductor whose music has, for many, been so associated with Christmas. Featuring the Royal Philharmonic Orchestra and The Bach Choir, with guest artists Over the Bridge and conducted by Rutter himself.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>The Colours of Christmas (track 2 from the album) is a newly composed carol by Rutter for this new album, and is testament to the very best of Rutter&rsquo;s music. Newly orchestrated for this album are the carols Ding Dong! Merrily On High and Hark! The Herald Angels Sing. All recordings on this album are brand new.</p>\r\n<p>TRACKLISTING</p>\r\n<p>1. Ding Dong! Merrily on High&nbsp;</p>\r\n<p>2. The Colours of Christmas&nbsp;</p>\r\n<p>3. In Dulci Jubilo&nbsp;</p>\r\n<p>4. What is this lovely fragrance?&nbsp;</p>\r\n<p>5. Away in a Manger&nbsp;</p>\r\n<p>6. Hodie Christus natus est&nbsp;</p>\r\n<p>7. Riu riu chiu&nbsp;</p>\r\n<p>8. I wonder as I wander&nbsp;</p>\r\n<p>9. Star Carol&nbsp;</p>\r\n<p>10. Once in Royal David\'s City&nbsp;</p>\r\n<p>11. Silent Night&nbsp;</p>\r\n<p>12. In the bleak midwinter&nbsp;</p>\r\n<p>13. Gabriel\'s Message&nbsp;</p>\r\n<p>14. Fanfare - O come, all ye faithful&nbsp;</p>\r\n<p>15. O Holy Night&nbsp;</p>\r\n<p>16. A New Year Carol&nbsp;</p>\r\n<p>17. Joy to the World&nbsp;</p>\r\n<p>18. Sleigh Ride&nbsp;</p>\r\n<p>19. Deck the Hall&nbsp;</p>\r\n<p>20. The Christmas Song&nbsp;</p>\r\n<p>21. The Twelve Days Of Christmas&nbsp;</p>\r\n<p>22. Have yourself a merry little Christmas&nbsp;</p>\r\n<p>23. Fanfare - Hark! the herald angels sing</p>\r\n</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
