	(203,'es','New Year\'s Concert 2012 Diverse Wr.Philharmoniker / Jansons,M. / Wr.Sän','','','<p><span style=\"color: #333333; font-family: \'Trebuchet MS\', serif, Times, \'Times New Roman\'; font-size: 12px; line-height: 18px; background-color: #ffffff;\">The traditional Vienna Philharmonic New Year\'s Concert on January 1, 2012, will be conducted for the second time by the Latvian conductor Mariss Jansons. Ever since the first concert together in April 1992, Mariss Jansons has belonged to the circle of conductors with whom the Vienna Philharmonic feels a special bond. His first New Year\'s Concert in 2006 was widely acclaimed by both audiences and the media. The New Year\'s Concert 2012 will once again be broadcast by the ORF to over 70 television networks and 300 radio stations worldwide.&nbsp;</span></p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
