	(208,'es','H.264 Megapixel Surveillance Camera TL-SC3430','','','<p>&nbsp;</p>\r\n<h3 style=\"padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 \'Trebuchet MS\', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;\">What This Product Does</h3>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff; line-height: 18pt;\"><span style=\"font-family: Arial, sans-serif;\" lang=\"EN-US\">With its built-in high performance 1.3Mega-Pixel sensor, the TL-SC3430 is excellent for homes, shops, banks, offices and other building surveillance where clearer video and more image detail are required. What is more exciting is that wherever users are, high definition video can be delivered to them with the most fluidity, through a standard web browser or 3G device so that users will be to stay close to what they care for most.<br />With simple installation, event alerts, 2-way audio and other practical functions, the TL-SC3430 is a perfect solution for the advanced viewer with attention to detail.</span></p>\r\n<h3 style=\"padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 \'Trebuchet MS\', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;\">1.3 Megapixel HD Video for Identification Surveillance</h3>\r\n<div style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff; line-height: 18pt; padding: 0px; margin: 0px;\">Equipped with high performance 1.3Mega-Pixel sensor, it can provide HD images that are more useful, with more image detail and with wider scope for identification, such as faces of people or a car&rsquo;s license plate.</div>\r\n<h3 style=\"padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 \'Trebuchet MS\', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;\">Advanced H.264 Codec Delivers Beautifully Smooth Video</h3>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 19px; text-align: left; background-color: #ffffff;\">&nbsp;H.264 is an advanced video compression technology that greatly reduces the size of a digital video file (up to 80%) without compromising video quality compared with video quantity. Using H.264 provides savings in network bandwidth and storage costs, as well as achieves much higher video quality for a given bit rate.&nbsp;</p>\r\n<h3 style=\"padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 \'Trebuchet MS\', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;\">Intelligent Surveillance Functionality</h3>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff; line-height: 18pt;\"><span style=\"font-family: Arial, sans-serif;\" lang=\"EN-US\">Motion detection settings make the camera record automatically and alert you via an e-mail when motion is detected.&nbsp;</span></p>\r\n<h3 style=\"padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 \'Trebuchet MS\', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;\">Multiple Easy Remote Viewing Options</h3>\r\n<div style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff; line-height: 18pt; padding: 0px; margin: 0px;\">TP-LINK\'s TL-SC3430 is compliant with 3GPP protocols, so users can look in on their cameras from 3G mobile Phones, laptops or tablets, such as Android&nbsp;<span style=\"font-size: 9pt;\">&trade;</span>&nbsp;phones or 3G enabled iPads&nbsp;<span style=\"font-size: 9pt;\">&trade;</span>.</div>\r\n<h3 style=\"padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 \'Trebuchet MS\', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;\">16-channel Management Software</h3>\r\n<div style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff; line-height: 18pt; padding: 0px; margin: 0px;\">The TL-SC3430&rsquo;s bundled surveillance software assists users with managing multiple cameras at the same time. With it, video from 16 cameras can be displayed on one screen. Users can archive streamed video and audio straight to their hard drives, playback video, and monitor up to 16 cameras on a single screen.</div>\r\n<h3 style=\"padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 \'Trebuchet MS\', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;\">2-Way Audio Communication</h3>\r\n<div style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff; line-height: 18pt; padding: 0px; margin: 0px;\">With the TL-SC3430&rsquo;s built-in microphone or one purchased separately, users can hear what&rsquo;s happening within range of their cameras remotely. What&rsquo;s more , by connecting an external speaker to the TL-SC3430, users may also speak to someone near the camera or give a public address depending on the speaker&rsquo;s strength. This brings users more convenience allowing for better communication when monitoring their cameras from a remote location.</div>\r\n<h3 style=\"padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 \'Trebuchet MS\', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;\">Easy Remote Access-DDNS &amp; UPnP</h3>\r\n<div style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 19px; text-align: left; background-color: #ffffff; padding: 0px; margin: 0px;\">Eliminating the need for users to remember a numeric IP address, the TL-SC3430&rsquo;s DDNS feature enables users to remotely access the camera by typing an easy-to-remember domain name (e.g. www.mycamera.com) into their browser. This feature comes in handy, especially when the camera&rsquo;s IP address is always changed by users&rsquo; Internet Service Providers. Even more convenient is if the camera is connected with a router and set up in a local area network, the router&rsquo;s UPnP function can facilitate access to the camera without any complicated configuration of the router or camera.<br /><br /></div>\r\n<p>&nbsp;</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(209,'es','HP Scanjet G3110 Scanner','','','<p>&nbsp;</p>\r\n<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px; padding-bottom: 10px;\">Make your photos, documents, slides, and negatives all look great by scanning them at 4800 x 9600<a class=\"dotline\" style=\"color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;\">dpi</a>resolution<sup style=\"font-size: 0.8em;\">1</sup>. Our Scanjet G3110 Photo Scanner comes with software that removes red eye, removes dust and scratches, and restores vibrant color to your old, faded images.</div>\r\n<div class=\"fl\" style=\"float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"><img style=\"border-style: initial; border-color: initial; padding: 0px; margin: 0px;\" src=\"http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/l2698a_open_left.jpg\" alt=\"Top surface with slides\" /></p>\r\n</div>\r\n<div class=\"col59pctL\" style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Excellent quality, affordable price</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Get great scans</strong>of black-and-white and color photos with the 4800 x 9600<a class=\"dotline\" style=\"color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;\">dpi</a>and 48-bit color</li>\r\n<li><strong>Remove red eye</strong>from scanned photos</li>\r\n<li><strong>Bring out 