	(210,'es','HP Photosmart Plus e-All-in-One Printer - B210a','','','<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px; padding-bottom: 10px;\">Touch your way to easy, affordable printing with our Photosmart Plus e-All-in-One &ndash; B210a. You\'ll get affordable lab-quality photos, everyday documents, creative projects, and Web pages. Plus, HP<a class=\"udrline\" style=\"color: #003366; text-decoration: underline;\" href=\"http://www.hp.com/go/eprintbanner\" target=\"_blank\">ePrint</a><sup style=\"font-size: 0.8em;\">1</sup>and<a class=\"dotline\" style=\"color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;\">integrated wireless</a>will keep you connected on the go.<sup style=\"font-size: 0.8em;\">1, 2</sup></div>\r\n<div class=\"fl\" style=\"float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"><img style=\"border-style: initial; border-color: initial; padding: 0px; margin: 0px;\" src=\"http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/cn216a_right_facing.jpg\" alt=\"HP Photosmart Plus e-All-in-One - B210a, right facing image\" /></p>\r\n</div>\r\n<div class=\"col59pctL\" style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Easy and affordable</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Print photos and documents,</strong>make copies, and scan&mdash;all without turning on your PC</li>\r\n<li><strong>Get lab-quality,</strong>smudge-resistant photos that last<sup style=\"font-size: 0.8em;\">3</sup></li>\r\n<li><strong>Use the automatic photo tray</strong>tray for easy picture printing</li>\r\n<li>Share photos with friends<sup style=\"font-size: 0.8em;\">4</sup>via Snapfish</li>\r\n<li><strong>Have fun</strong>with photos using the included software</li>\r\n<li><strong>Print affordably</strong>with individual HP inks; save money with our high-capacity XL cartridges (sold separately) for frequent printing</li>\r\n<li><strong>Get templates</strong>for calendars and games with HP<a class=\"udrline\" style=\"color: #003366; text-decoration: underline;\" href=\"http://h71036.www7.hp.com/hho/us/en/ep/articles/quick-forms.html\" target=\"_blank\">Quick Forms</a><sup style=\"font-size: 0.8em;\">4</sup></li>\r\n</ul>\r\n</div>\r\n<div class=\"fl\" style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Quick Web printing, no PC</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Print from the Web without a PC</strong>&mdash;photos, coupons, recipes, greeting cards and more with customizable<a class=\"udrline\" style=\"color: #003366; text-decoration: underline;\" href=\"http://www.hp.com/go/eprintcenter\" target=\"_blank\">print apps</a><sup style=\"font-size: 0.8em;\">4</sup></li>\r\n<li><strong>Use the intuitive</strong>TouchSmart screen to make copies, photo reprints, and scans</li>\r\n<li><strong>Print and share</strong>from multiple PCs via the<a class=\"dotline\" style=\"color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;\">integrated wireless</a><sup style=\"font-size: 0.8em;\">2</sup></li>\r\n<li><strong>Just touch a button</strong>to print wirelessly<sup style=\"font-size: 0.8em;\">5</sup></li>\r\n<li><strong>Print wirelessly</strong>from a smartphone with our<a class=\"udrline\" style=\"color: #003366; text-decoration: underline;\" href=\"http://www.hp.com/go/mobile-printing-solutions\" target=\"_blank\">mobile printing apps</a><sup style=\"font-size: 0.8em;\">6</sup></li>\r\n</ul>\r\n</div>\r\n<div class=\"fr\" style=\"float: right; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-bottom: 10px;\">\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"><img style=\"border-style: initial; border-color: initial; padding: 0px; margin: 0px;\" src=\"http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/cn216a_top_view.jpg\" alt=\"HP Photosmart Plus e-All-in-One - B210a, top view image\" /></p>\r\n</div>\r\n<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">If you can e-mail it, you can print it</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Print directly</strong>to your HP printer using a smartphone, laptop, or other mobile device with HP ePrint</li>\r\n<li><strong>Print from your iPad, iPhone, or iPod touch</strong><sup style=\"font-size: 0.8em;\">7</sup>wirelessly with<a class=\"udrline\" style=\"color: #003366; text-decoration: underline;\" href=\"http://www.hp.com/go/airprint\" target=\"_blank\">AirPrint</a></li>\r\n</ul>\r\n</div>\r\n<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Helping conserve resources</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Save energy</strong>with this efficient, ENERGY STAR<sup style=\"font-size: 0.8em;\">&reg;</sup>qualified machine</li>\r\n<li><strong>Recycle:</strong>return your cartridges via our Planet Partners program<sup style=\"font-size: 0.8em;\">8</sup></li>\r\n</ul>\r\n</div>\r\n<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Peace of mind</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Protect your investment</strong>with the one-year limited warranty plus and one year of toll-free tech support</li>\r\n<li><strong>Get product questions answered</strong>toll-free, 24 x 7, or via e-mail in as little time as an hour</li>\r\n<li><strong>Get exclusive offers</strong>and discounts on supplies, shop from your own supplies list, and get free next-day shipping with \"My Print Rewards\"</li>\r\n</ul>\r\n</div>\r\n<div class=\"p10\" style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding: 10px;\">\r\n<h2 class=\"theme_ruled\" style=\"font-size: small; margin-bottom: 0px; margin-top: 1px; border-bottom-width: 4px; border-bottom-style: solid; padding-bottom: 1px; border-color: #000000;\">What\'s in the box?</h2>\r\n<p class=\"fl mt10 mr10\" style=\"margin-top: 10px; margin-right: 10px; margin-bottom: 10px; margin-left: 0px; float: left;\"><img style=\"border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;\" longdesc=\"http://www.shopping.hp.com/product/printer/Photosmart/1/storefronts/CN216A%2523B1H\" src=\"http://hpshopping.speedera.net/s7d2.scene7.com/is/image/HPShopping/full3_fmt/cn216a_main.jpg\" border=\"0\" alt=\"HP Photosmart Plus e-All-in-One Printer - B210a\" width=\"150\" height=\"100\" /></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Printer</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Power supply</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Power cord</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Accessory bag</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>HP 564 black cartridge (approx. 250 pages)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>HP 564 cyan, magenta, yellow cartridge (approx. 300 pages each)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>CD with software</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Reference guide</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<div class=\"p10\" style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; margin-top: 10px; padding: 10px;\">\r\n<h2 class=\"theme_ruled\" style=\"font-size: small; margin-bottom: 0px; margin-top: 1px; border-bottom-width: 4px; border-bottom-style: solid; padding-bottom: 1px; border-color: #000000;\">Compatible with</h2>\r\n<p class=\"fl mt10 mr10\" style=\"margin-top: 10px; margin-right: 10px; margin-bottom: 10px; margin-left: 0px; float: left;\"><img style=\"border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;\" src=\"http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/logos/icon_windows_compatible.gif\" alt=\"Windows compatible\" width=\"20\" height=\"15\" /><img style=\"border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;\" src=\"http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/logos/icon_compatible_mac.gif\" alt=\"Mac compatible\" width=\"20\" height=\"15\" /></p>\r\n</div>\r\n<p>&nbsp;</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
	(211,'es','HP Officejet Pro 8600 Premium e-All-in-One Printer','','','<p>&nbsp;</p>\r\n<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px; padding-bottom: 10px;\">View apps on our Officejet Pro 8600A Premium e-All-in-One\'s large touchscreen. Get networking and versatile performance; get professional-color documents for a cost per page of up to 50% lower than with laser printers.<sup style=\"font-size: 0.8em;\">1</sup>You can even print from a mobile device via HP<a class=\"udrline\" style=\"color: #003366; text-decoration: underline;\" href=\"http://www.hp.com/go/eprintbanner\" target=\"_blank\">ePrint</a>.<sup style=\"font-size: 0.8em;\">2</sup></div>\r\n<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Professional color, economical price</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Get great-looking color</strong>for a cost per page of up to 50% lower than with lasers, and get better value with frequent printing<sup style=\"font-size: 0.8em;\">3</sup></li>\r\n<li><strong>Resist fading,</strong>water and highlighter-pen smears when using HP Officejet inks<sup style=\"font-size: 0.8em;\">4, 5</sup></li>\r\n<li><strong>Print at ISO speeds up to 20 ppm black</strong>and 16 color when using our affordable individual inks<sup style=\"font-size: 0.8em;\">6</sup></li>\r\n<li><strong>Rely on the 25,000-page</strong>monthly<a class=\"dotline\" style=\"color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;\">duty cycle</a></li>\r\n</ul>\r\n</div>\r\n<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Web connectivity and mobile printing</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Print from virtually anywhere,</strong>and from a variety of mobile devices, using HP ePrint</li>\r\n<li><strong>Use the large touchscreen</strong>with gesturing to access business apps, plus print and store files</li>\r\n<li><strong>View and print photos</strong>from a USB drive and<a class=\"dotline\" style=\"color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;\">memory cards</a></li>\r\n<li><strong>Stay connected</strong>&mdash;share on a wireless or wired network<sup style=\"font-size: 0.8em;\">7</sup></li>\r\n</ul>\r\n</div>\r\n<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Versatile for copying and scanning</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Make flawless copies</strong>with the CopySmart feature</li>\r\n<li><strong>Print a one-sided copy</strong>of a two-sided ID card</li>\r\n<li><strong>Automatically print, copy, and scan</strong>on both sides of the page</li>\r\n<li><strong>Get more done</strong>with the 50-page<a class=\"dotline\" style=\"color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;\">automatic document feeder</a></li>\r\n<li><strong>Improve workflow</strong>&mdash;send faxes, scan documents to a PC or e-mail, and more</li>\r\n<li><strong>Create borderless, double-sided flyers</strong>and brochures, plus print impressive business photos</li>\r\n<li><strong>Use original HP ink</strong>for quality, reliability and rewards<sup style=\"font-size: 0.8em;\">8</sup></li>\r\n</ul>\r\n</div>\r\n<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Energy and resource saver</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Reduce energy use</strong>by up to 50% compared with laser printers with this ENERGY STAR<sup style=\"font-size: 0.8em;\">&reg;</sup>qualified printer<sup style=\"font-size: 0.8em;\">9</sup>and preset on/off times</li>\r\n<li><strong>Use up to 70% less in supplies</strong>and packaging by weight, compared with laser printers<sup style=\"font-size: 0.8em;\">10</sup></li>\r\n<li><strong>Automatically print two-sided</strong>with the<a class=\"dotline\" style=\"color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;\">automatic document feeder</a>; cut your paper use in half</li>\r\n<li><strong>Recycle</strong>your cartridges&mdash;it\'s free and easy<sup style=\"font-size: 0.8em;\">11</sup></li>\r\n</ul>\r\n</div>\r\n<div style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;\">\r\n<h3 class=\"cb large mb5\" style=\"font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;\">Peace of mind</h3>\r\n<ul style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;\">\r\n<li><strong>Protect your investment</strong>with World-class service and support. One-year limited hardware warranty, 24-hour, 7 days a week Web support, business hour phone support within warranty period.</li>\r\n</ul>\r\n</div>\r\n<div class=\"p10\" style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding: 10px;\">\r\n<p class=\"tinygray\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: #666666; font-size: 10px;\"><span style=\"font-size: small; color: #000000;\">What\'s in the box?</span></p>\r\n</div>\r\n<div class=\"p10\" style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding: 10px;\">\r\n<p class=\"fl mt10 mr10\" style=\"margin-top: 10px; margin-right: 10px; margin-bottom: 10px; margin-left: 0px; float: left;\"><img style=\"border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;\" longdesc=\"http://www.shopping.hp.com/product/printer/Officejet+Pro/1/storefronts/CN577A%2523B1H\" src=\"http://hpshopping.speedera.net/s7d2.scene7.com/is/image/HPShopping/full3_fmt/cn577a_main.jpg\" border=\"0\" alt=\"HP Officejet Pro 8600 Premium e-All-in-One Printer\" width=\"150\" height=\"100\" /></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Printer</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Automatic two-sided printing accessory</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Second 250 sheet input tray</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>HP 950 Setup Black Officejet Ink Cartridge (~ 1,000 pages)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>HP 951 Setup Cyan Officejet Ink Cartridge</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>HP 951 Setup Magenta Officejet Ink Cartridge</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>HP 951 Setup Yellow Officejet Ink Cartridge: composite yield (~ 700 pages),</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Second set of color cartridges</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Power cord</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Phone cord</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Set-up poster</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>Getting started guide</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>In-house marketing kit</td>\r\n</tr>\r\n<tr>\r\n<td width=\"10\" valign=\"top\">&bull;</td>\r\n<td>CDs with software, Windows and Mac printer drivers, user guide</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<div class=\"p10\" style=\"color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; margin-top: 10px; padding: 10px;\">\r\n<h2 class=\"theme_ruled\" style=\"font-size: small; margin-bottom: 0px; margin-top: 1px; border-bottom-width: 4px; border-bottom-style: solid; padding-bottom: 1px; border-color: #000000;\">Compatible with</h2>\r\n<p class=\"fl mt10 mr10\" style=\"margin-top: 10px; margin-right: 10px; margin-bottom: 10px; margin-left: 0px; float: left;\"><img style=\"border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;\" src=\"http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/logos/icon_windows_compatible.gif\" alt=\"Windows compatible\" width=\"20\" height=\"15\" /><img style=\"border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;\" src=\"http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/logos/icon_compatible_mac.gif\" alt=\"Mac compatible\" width=\"20\" height=\"15\" /></p>\r\n</div>\r\n<p>&nbsp;</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>');
