	(212,'es','Panasonic KX-MB2000 24PPM 3-in-1 Monochrome Laser MFP','','','<p>&nbsp;</p>\r\n<h3 style=\"border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; color: #000000; line-height: 12px; padding: 0px; margin: 0px; border: 0px initial initial;\">Robust Feature Set &amp; Superior Ease of Use.</h3>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 16px; color: #40474b; border: 0px initial initial;\">The KX-MB2000 includes standard printing, color scanning, and copying capabilities to meet the demands of todays businesses. The KX-MB2000 boasts a highly reliable print engine with an easy open clam shell design which makes consumable replacement and the removal of the occasional paper jam extremely easy. In addition, the KX-MB2000 includes a 10/100 Base-TX Ethernet interface for convenient device sharing in multi-user office environments, not to mention the ability to remotely manage and configure the device using a standard internet browser.</p>\r\n<h3 style=\"border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; color: #000000; line-height: 12px; padding: 0px; margin: 0px; border: 0px initial initial;\">High Speed, Professional-Quality Laser Printing</h3>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 16px; color: #40474b; border: 0px initial initial;\">The KX-MB2000 is capable of outputting up to 24 professional quality documents per minute<sup style=\"border-image: initial; font-size: 7px; font: inherit; display: inline; line-height: 7px; padding: 0px; margin: 0px; border: 0px initial initial;\">1</sup>&nbsp;at 600 x 600 DPI. The KX-MB2000 includes a Host Based GDI printer driver which has been optimized for maximum printing productivity. The advanced printing features of the GDI printer driver include the ability to add watermarks to printed documents, print or create document Overlays, merge up to 16 documents on a single sheet of paper, or enlarge your document to a wall size poster.</p>\r\n<h3 style=\"border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; color: #000000; line-height: 12px; padding: 0px; margin: 0px; border: 0px initial initial;\">PC &amp; Network Document Scanner</h3>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 16px; color: #40474b; border: 0px initial initial;\">The built in document flatbed on the KX-MB2000, is able to scan documents directly to a PC, E-mail, shared network folder or FTP server. Scanned documents can be saved as a PDF, JPG, TIFF or BMP file. The KX-MB2000 is capable of scanning documents in full color with resolutions up to 19,200 x 19,200 dpi (Interpolated).</p>\r\n<h3 style=\"border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; color: #000000; line-height: 12px; padding: 0px; margin: 0px; border: 0px initial initial;\">Convenient Desktop Copier</h3>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 16px; color: #40474b; border: 0px initial initial;\">The KX-MB2000 can also be used a desktop copy machine, utilizing the standard document flatbed. The KX-MB2000 offers many convenient copy features, such as Image Repeat, N in 1 Copy, Separate N in 1 Copy, Quick ID Copy and Proof Copy.</p>\r\n<h3 style=\"border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; color: #000000; line-height: 12px; padding: 0px; margin: 0px; border: 0px initial initial;\">Panasonic Multifunction Station Suite Software</h3>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 16px; color: #40474b; border: 0px initial initial;\">The KX-MB2000 comes bundled with the Panasonic Multifunction Station Suite Software, which includes all the software and utilities for the device. The bundled software suite includes; Panasonic\'s Multi-function viewer software which allows you to view scanned documents, remotely adjust the device configuration with the Remote control utility, and the Device Manager Application which provides a real time view of the devices current state.</p>\r\n<h3 style=\"border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; color: #000000; line-height: 12px; padding: 0px; margin: 0px; border: 0px initial initial;\">Advanced Document Management</h3>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 16px; color: #40474b; border: 0px initial initial;\">The KX-MB2000 features Panasonic\'s newest software application, the Panasonic Easy Print Utility. This intuitive application allows you to merge multiple documents into a single print job, which can then be previewed from your computers monitor before actual printing, to ensure the document layout is correct without wasting paper and toner. In addition, the KX-MB2000 includes a copy of Readiris Pro 7, which will allow you to convert your digital documents into text editable file formats.</p>','','','','','','<p class=\"product-promo-text\"><span class=\"product-promo-header\">FREE US shipping over $100!</span><span class=\"product-promo-body\">Orders within next 2 days will be shipped on Monday</span></p>'),
