INSERT INTO `cscart_status_descriptions` (`status`, `type`, `description`, `email_subj`, `email_header`, `lang_code`)
VALUES
	('C','O','Complete','has been completed','Your order has been completed. Thank you for choosing us.','en'),
	('P','O','Processed','has been processed','Your order has been processed successfully.','en'),
	('O','O','Open','has been placed successfully.','Thank you for the order. You are welcome to come back!','en'),
	('F','O','Failed','failed','Your order has been unsuccessful. Please contact shop administration.','en'),
	('D','O','Declined','has been declined','Your order has been declined. Please contact shop administration.','en'),
	('B','O','Backordered','has been backordered','Your order has been backordered.','en'),
	('I','O','Canceled','has been canceled','Your order has been canceled. Please contact shop administration.','en'),
	('C','O','Completado','ha sido completado','<p>Su pedido ha sido enviado. Esperamos que disfrute de los productos que ha adquirido.</p>\n\n<p>Gracias por elegirnos.</p>','es'),
	('P','O','Procesado','ha sido procesado','<p>Su pedido ha sido procesado con &eacute;xito. En breve procederemos a su env&iacute;o.</p>','es'),
	('O','O','Abierto','su orden de pedido ha sido recibida con exito','Gracias por hacer su pedido con nuestro sistema de compra, en breve procederemos a procesarlo.','es'),
	('F','O','Frustrado','fracasado','Su pedido ha fallado y no se va a procesar. Por favor póngase en contacto con la administraci&oacute;n de la tienda.</p>\n\n<p>Para ponerse en contacto con nosotros puede hacer click <a href=\"http://www.boutiquedeliberico.es/es/contact_us.html\" onclick=\"window.open(this.href,\'\',\'resizable=yes,location=no,menubar=no,scrollbars=yes,status=no,toolbar=no,fullscreen=no,dependent=no,status\'); return false\">aqu&iacute;.</a></p>','es'),
	('D','O','Rechazado','ha sido rechazado','<p>Su pedido ha sido rechazado. Por favor póngase en contacto con la administraci&oacute;n de la tienda.</p>\n\n<p>Para ponerse en contacto con nosotros puede hacer click <a href=\"http://www.boutiquedeliberico.es/es/contact_us.html\" onclick=\"window.open(this.href,\'\',\'resizable=yes,location=no,menubar=no,scrollbars=yes,status=no,toolbar=no,fullscreen=no,dependent=no,status\'); return false\">aqu&iacute;.</a></p>','es'),
	('B','O','Aplazado','ha sido aplazado','<p>Su pedido ha sido aplazado. Esto puede deberse a que uno o varios art&iacute;culos de su pedido est&eacute;n agotados en estos momentos.</p>\n\n<p>Si quiere conocer m&aacute;s detalles p&oacute;ngase en contacto con nosotros haciendo click <a href=\"http://www.boutiquedeliberico.es/es/contact_us.html\" onclick=\"window.open(this.href,\'\',\'resizable=yes,location=no,menubar=no,scrollbars=yes,status=no,toolbar=no,fullscreen=no,dependent=no,status\'); return false\">aqu&iacute;.</a> O si lo prefiere puede esperar a que tengamos stock y procedamos al env&iacute;o de su pedido.</p>\n\n<p>Le pedimos disculpas por las molestias que esta situaci&oacute;n le puedan causar.</p>\n\n<p>&nbsp;</p>\n\n<p>Reciba un cordial saludo</p>','es'),
	('I','O','Cancelado','ha sido cancelado','<p>Su pedido ha sido <strong>cancelado</strong>. Por favor p&oacute;ngase en contacto con la administraci&oacute;n de la tienda.</p>\n\n<p>Para ponerse en contacto con nosotros puede hacer click <a href=\"http://www.boutiquedeliberico.es/es/contact_us.html\" onclick=\"window.open(this.href,\'\',\'resizable=yes,location=no,menubar=no,scrollbars=yes,status=no,toolbar=no,fullscreen=no,dependent=no,status\'); return false\">aqu&iacute;.</a></p>','es'),
	('Y','O','Awaiting call','Awaiting call','Awaiting call','en'),
	('Y','O','Awaiting call','Awaiting call','Awaiting call','es'),
	('P','G','Pending','has been created.','Your gift certificate has been created successfully. Please wait until it is activated.','en'),
	('P','G','Pendiente','ha sido creado.','Su certificado de regalo ha sido creado con éxito. Por favor espere hasta que sea activado.','es'),
	('A','G','Active','has been activated.','Your gift certificate has status Active. You can use it now.','en'),
	('A','G','Activo','ha sido activado.','Su certificado de regalo está activo. Usted puede usarlo ahora.','es'),
	('C','G','Disabled','has been disabled.','Your gift certificate has been disabled. Please contact shop administration.','en'),
	('C','G','Cancelado','has been cancelled.','Su certificado de regalo ha sido cancelado. Por favor contacte con la administración de la tienda.','es'),
	('U','G','Used','has been used.','Your gift certificate is spent. Thank you for choosing us.','en'),
	('U','G','Usado','ha sido usado.','Su certificado de regalo ha sido utilizado. Gracias por elegirnos.','es'),
	('R','R','Requested','has been requested successfully.','Your return has been requested successfully.','en'),
	('R','R','Solicitada','ha sido solicitada con éxito.','Su petición de devolución ha sido solicitada con éxito.','es'),
